INSERT INTO `mvc_article` (`id`, `title`, `subtitle`, `content`, `article_index`, `logo`, `section_index`, `lang`) VALUES
(1, 'none', 'none', '<h2>The Report</h2>The Africa SDG Index and Dashboard Report examines where African nations stand in relation to achieving the Sustainable Development Goals (SDGs) and the African Union 2063 Agenda â€” in particular some measures of continental integration, a core component of this African agenda. It is more than a report; it is a tool for local and national governments, academia, and civil society that focuses specifically on the African context to track progress, to help pinpoint key implementation challenges, and to support national and regional discussions toward both agendas. <br><br><p>The Africa SDG Index and Dashboard Report includes indicators that are pertinent to the continent and provides a richer assessment of the specific SDG-related challenges faced by African countries and how successful those countries are in overcoming them. The report collects and synthesizes the most detailed available data on the SDGs from official and other verifiable sources.</p><h5>The Index</h5><p>The Index provides an aggregate measure of progress across all 17 SDGs using available data, including official SDG indicators as well as alternative metrics from trusted official and other verifiable sources.</p><h5>The Dashboards</h5><p>The Dashboards provide a goal-level snapshot that is color-coded from red to green, which signifies goal achievement. Sub-regional dashboards are also available to allow countries to see how they are performing compared to their neighbors. &nbsp;It also includes a trends analysis by each indicator to project the pace at which countries are closing the gap to each indicator and goal achievement.</p><p><br></p><p></p><hr><p></p><p></p><p></p>', 'KCyF3uhi', '', 'kJOHh0Fb', 'en'),
(4, 'https://twitter.com/sdgcafrica?lang=en', 'http://facebook.com/SDGCAfrica', '<h3>About Publishers</h3><p></p><h5>Sustainable Development Goals Center for Africa</h5><p></p><p><a href=\"http://sdgcafrica.org\">The Sustainable Development Goals Center for Africa</a>&nbsp;is deeply committed to accelerating the implementation of the SDGs across the continent, including developing a new program to help governments build and strengthen capacity on data and statistical systems for monitoring and reporting on the SDGs.</p>', 'g0xuf2ua', '', 'kJOHh0Fb', 'en'),
(5, 'https://twitter.com/UNSDSN?lang=en', 'https://www.facebook.com/UNSDSN/', '<h5>Sustainable Development Solutions Network (SDSN)</h5><a href=\"http://unsdsn.org\">The Sustainable Development Solutions Network (SDSN) </a>has operated under the auspices of the UN Secretary-General since 2012 and mobilizes global scientific and technological expertise to promote practical solutions for sustainable development, including the implementation of the SDGs and the Paris Climate Agreement.', 'du0u0GfE', '', 'kJOHh0Fb', 'en'),
(6, 'none', 'none', '<h2>Ibinjyanye na raporo</h2><p>The Africa SDG Index and Dashboard Report examines where African nations stand in relation to achieving the Sustainable Development Goals (SDGs) and the African Union 2063 Agenda â€” in particular some measures of continental integration, a core component of this African agenda. It is more than a report; it is a tool for local and national governments, academia, and civil society that focuses specifically on the African context to track progress, to help pinpoint key implementation challenges, and to support national and regional discussions toward both agendas. </p><br>The Africa SDG Index and Dashboard Report includes indicators that are pertinent to the continent and provides a richer assessment of the specific SDG-related challenges faced by African countries and how successful those countries are in overcoming them. The report collects and synthesizes the most detailed available data on the SDGs from official and other verifiable sources.<br>', 'KCyF3uhi', '', 'kJOHh0Fb', 'rw'),
(7, 'none', 'none', '<h1>About the Index</h1>The Index provides an aggregate measure of progress across all 17 SDGs using available data, including official SDG indicators as well as alternative metrics from trusted official and other verifiable sources.<br>', 'wuFj7vFa', '', 'kJOHh0Fb', 'rw'),
(8, 'none', 'none', '<h1>About the Dashboards</h1>The Dashboards provide a goal-level snapshot that is color-coded from red to green, which signifies goal achievement. Sub-regional dashboards are also available to allow countries to see how they are performing compared to their neighbors. &nbsp;It also includes a trends analysis by each indicator to project the pace at which countries are closing the gap to each indicator and goal achievement.', 'jFfhhHud', '', 'kJOHh0Fb', 'rw'),
(9, 'https://twitter.com/sdgcafrica?lang=en', 'http://facebook.com/SDGCAfrica', '<h1>About the Publishers</h1><h4>Sustainable Development Goals Center for Africa</h4>The Sustainable Development Goals Center for Africa (hyperlink: sdgcafrica.org) is deeply committed to accelerating the implementation of the SDGs across the continent, including developing a new program to help governments build and strengthen capacity on data and statistical systems for monitoring and reporting on the SDGs.', 'g0xuf2ua', '', 'kJOHh0Fb', 'rw'),
(10, 'https://twitter.com/UNSDSN?lang=en', 'https://www.facebook.com/UNSDSN/', '<h4>Sustainable Development Solutions Network (SDSN)</h4>The Sustainable Development Solutions Network (SDSN) (hyperlink: unsdsn.org) has operated under the auspices of the UN Secretary-General since 2012 and mobilizes global scientific and technological expertise to promote practical solutions for sustainable development, including the implementation of the SDGs and the Paris Climate Agreement.', 'du0u0GfE', '', 'kJOHh0Fb', 'rw'),
(12, 'NO POVERTY', '1', '<p></p>Eradicating poverty in all its forms remains one of the greatest challenges facing humanity. While the number of people living in extreme poverty dropped by more than half between 1990 and 2015 â€“ from 1.9 billion to 836 million â€“ too many are still struggling for the most basic human needs.<br><br>Globally, more than 800 million people are still living on less than US$1.25 a day, many lacking access to adequate food, clean drinking water and sanitation. Rapid economic growth in countries like China and India has lifted millions out of poverty, but progress has been uneven. Women are more likely to live in poverty than men due to unequal access to paid work, education and property.<br><br>Progress has also been limited in other regions, such as South Asia and sub-Saharan Africa, which account for 80 percent of those living in extreme poverty. New threats brought on by climate change, conflict and food insecurity, mean even more work is needed to bring people out of poverty.<br><br>The SDGs are a bold commitment to finish what we started, and end poverty in all forms and dimensions by 2030. This involves targeting the most vulnerable, increasing access to basic resources and services, and supporting communities affected by conflict and climate-related disasters.<br><p></p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'ilffPuEk', 'none', 'aefhMeKu', 'en'),
(13, 'ZERO HUNGER', '2', 'Rapid economic growth and increased agricultural productivity over the past two decades have seen the number of undernourished people drop by almost half. Many developing countries that used to suffer from famine and hunger can now meet the nutritional needs of the most vulnerable. Central and East Asia, Latin America and the Caribbean have all made huge progress in eradicating extreme hunger.<p><br>These are all huge achievements in line with the targets set out by the first Millennium Development Goals. Unfortunately, extreme hunger and malnutrition remain a huge barrier to development in many countries. 795 million people are estimated to be chronically undernourished as of 2014, often as a direct consequence of environmental degradation, drought and loss of biodiversity. Over 90 million children under the age of five are dangerously underweight. And one person in every four still goes hungry in Africa.<br><br>The SDGs aim to end all forms of hunger and malnutrition by 2030, making sure all people â€“ especially children â€“ have access to sufficient and nutritious food all year round. This involves promoting sustainable agricultural practices: supporting small scale farmers and allowing equal access to land, technology and markets. It also requires international cooperation to ensure investment in infrastructure and technology to improve agricultural productivity. Together with the other goals set out here, we can end hunger by 2030.<br></p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'iCceEFfH', 'none', 'aefhMeKu', 'en'),
(14, 'none', 'none', '<h2>The Report</h2>The Africa SDG Index and Dashboard Report examines where African nations stand in relation to achieving the Sustainable Development Goals (SDGs) and the African Union 2063 Agenda â€” in particular some measures of continental integration, a core component of this African agenda. It is more than a report; it is a tool for local and national governments, academia, and civil society that focuses specifically on the African context to track progress, to help pinpoint key implementation challenges, and to support national and regional discussions toward both agendas. <br><br><p>The Africa SDG Index and Dashboard Report includes indicators that are pertinent to the continent and provides a richer assessment of the specific SDG-related challenges faced by African countries and how successful those countries are in overcoming them. The report collects and synthesizes the most detailed available data on the SDGs from official and other verifiable sources.</p><h5>The Index</h5><p>The Index provides an aggregate measure of progress across all 17 SDGs using available data, including official SDG indicators as well as alternative metrics from trusted official and other verifiable sources.</p><h5>The Dashboards</h5><p>The Dashboards provide a goal-level snapshot that is color-coded from red to green, which signifies goal achievement. Sub-regional dashboards are also available to allow countries to see how they are performing compared to their neighbors. &nbsp;It also includes a trends analysis by each indicator to project the pace at which countries are closing the gap to each indicator and goal achievement.</p><p><br></p><p></p><hr><p></p><p></p><p></p>', 'KCyF3uhi', '', 'kJOHh0Fb', 'sw'),
(15, 'https://twitter.com/sdgcafrica?lang=en', 'http://facebook.com/SDGCAfrica', '<h3>About publishers</h3><p></p><h5>Sustainable Development Goals Center for Africa</h5><p></p><p><a href=\"http://sdgcafrica.org\">The Sustainable Development Goals Center for Africa</a>&nbsp;is deeply committed to accelerating the implementation of the SDGs across the continent, including developing a new program to help governments build and strengthen capacity on data and statistical systems for monitoring and reporting on the SDGs.</p>', 'g0xuf2ua', '', 'kJOHh0Fb', 'sw'),
(16, 'https://twitter.com/UNSDSN?lang=en', 'https://www.facebook.com/UNSDSN/', '<h5>Sustainable Development Solutions Network (SDSN)</h5><a href=\"http://unsdsn.org\">The Sustainable Development Solutions Network (SDSN) </a>has operated under the auspices of the UN Secretary-General since 2012 and mobilizes global scientific and technological expertise to promote practical solutions for sustainable development, including the implementation of the SDGs and the Paris Climate Agreement.', 'du0u0GfE', '', 'kJOHh0Fb', 'sw'),
(17, 'We are getting ready to launch ', 'none', 'We are getting ready to launch our SDG Africa Index and Dashboards <br>', 'wffFKuh8', '', 'd3Vick8S', 'sw'),
(18, 'End poverty in all its forms everywhere', '1', '<p><p>The <a href=\"https://www.un.org/sustainabledevelopment/poverty/\">UN explains</a>: <q><a href=\"https://ourworldindata.org/extreme-poverty\">Extreme poverty</a> rates have fallen by more than half since 1990. While this is a remarkable achievement, one-in-five people in developing regions still live on less than $1.90 a day. Millions more make little more than this daily amount and are at risk of slipping back into extreme poverty.</q></p><p>Sustainable Development Goal 1 (SDG1) aims to eradicate extreme poverty by 2030. The visualizations and data below present the latest data on our progress there.</p><p>Longer-term trends, correlates and additional data on extreme poverty can be found at the <i>Our World in Data</i> entry on <a href=\"https://ourworldindata.org/extreme-poverty\">Global Extreme Poverty</a>.</p><p>The UN has defined 7 <i>Targets</i> and 14 <i>Indicators</i> for SDG 1. Targets specify the goals and Indicators represent the metrics by which the world aims to track whether these Targets are achieved. Below we quote the original text of all Targets and show the data on the agreed Indicators.</p></p>', 'ilffPuEk', '', 'aefhMeKu', 'sw'),
(19, 'End hunger, achieve food security and improved nutrition and promote sustainable agriculture', '2', '<p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\">The&nbsp;<a href=\"https://www.un.org/sustainabledevelopment/hunger/\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">UN explains</a>:&nbsp;<i>\"It is time to rethink how we grow, share and consume our food.</i></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\"><i>If done right, agriculture, forestry and fisheries can provide nutritious food for all and generate decent incomes, while supporting people-centred rural development and protecting the environment.</i></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\"><i>Right now, our soils, freshwater, oceans, forests and biodiversity are being rapidly degraded. Climate change is putting even more pressure on the resources we depend on, increasing risks associated with disasters such as droughts and floods. Many rural women and men can no longer make ends meet on their land, forcing them to migrate to cities in search of opportunities.</i></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\"><i>A profound change of the global food and agriculture system is needed if we are to nourish todayâ€™s 815 million hungry and the additional 2 billion people expected by 2050.</i></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\"><i>The food and agriculture sector offers key solutions for development, and is central for hunger and poverty eradication.\"</i></p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\">You can find many more visuals and statistics on&nbsp;<a href=\"https://ourworldindata.org/hunger-and-undernourishment\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">hunger and undernourishment</a>,&nbsp;<a href=\"https://ourworldindata.org/micronutrient-deficiency\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">micronutrient deficiencies</a>&nbsp;and&nbsp;<a href=\"https://ourworldindata.org/obesity\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">obesity</a>&nbsp;at the&nbsp;<i>Our World in Data</i>&nbsp;entries on these topics. Our entries on&nbsp;<a href=\"https://ourworldindata.org/famines\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">famines</a>,&nbsp;<a href=\"https://ourworldindata.org/food-per-person\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">food per person</a>, and&nbsp;<a href=\"https://ourworldindata.org/diet-compositions\" style=\"color: rgb(51, 102, 204); text-decoration-line: none;\">diet compositions</a>&nbsp;also tie closely to these topics.</p><p style=\"margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\">The UN has defined 8&nbsp;<i>Targets</i>&nbsp;and 13&nbsp;<i>Indicators</i>&nbsp;for SDG 2. Targets specify the goals and Indicators represent the metrics by which the world aims to track whether these Targets are achieved. Below we quote the original text of all&nbsp;<i>Targets</i>&nbsp;and show the data on the agreed Indicators.</p>', 'iCceEFfH', '', 'aefhMeKu', 'sw'),
(20, 'none', 'none', '<h2>The Report</h2>The Africa SDG Index and Dashboard Report examines where African nations stand in relation to achieving the Sustainable Development Goals (SDGs) and the African Union 2063 Agenda â€” in particular some measures of continental integration, a core component of this African agenda. It is more than a report; it is a tool for local and national governments, academia, and civil society that focuses specifically on the African context to track progress, to help pinpoint key implementation challenges, and to support national and regional discussions toward both agendas. <br><br><p>The Africa SDG Index and Dashboard Report includes indicators that are pertinent to the continent and provides a richer assessment of the specific SDG-related challenges faced by African countries and how successful those countries are in overcoming them. The report collects and synthesizes the most detailed available data on the SDGs from official and other verifiable sources.</p><h5>The Index</h5><p>The Index provides an aggregate measure of progress across all 17 SDGs using available data, including official SDG indicators as well as alternative metrics from trusted official and other verifiable sources.</p><h5>The Dashboards</h5><p>The Dashboards provide a goal-level snapshot that is color-coded from red to green, which signifies goal achievement. Sub-regional dashboards are also available to allow countries to see how they are performing compared to their neighbors. &nbsp;It also includes a trends analysis by each indicator to project the pace at which countries are closing the gap to each indicator and goal achievement.</p><p><br></p><p></p><hr><p></p><p></p><p></p>', 'KCyF3uhi', '', 'kJOHh0Fb', 'fr'),
(21, 'https://twitter.com/sdgcafrica?lang=en', 'http://facebook.com/SDGCAfrica', '<h3>About Publishers</h3><p></p><h5>Sustainable Development Goals Center for Africa</h5><p></p><p><a href=\"http://sdgcafrica.org\">The Sustainable Development Goals Center for Africa</a>&nbsp;is deeply committed to accelerating the implementation of the SDGs across the continent, including developing a new program to help governments build and strengthen capacity on data and statistical systems for monitoring and reporting on the SDGs.</p>', 'g0xuf2ua', '', 'kJOHh0Fb', 'fr'),
(22, 'https://twitter.com/UNSDSN?lang=en', 'https://www.facebook.com/UNSDSN/', '<h5>Sustainable Development Solutions Network (SDSN)</h5><a href=\"http://unsdsn.org\">The Sustainable Development Solutions Network (SDSN) </a>has operated under the auspices of the UN Secretary-General since 2012 and mobilizes global scientific and technological expertise to promote practical solutions for sustainable development, including the implementation of the SDGs and the Paris Climate Agreement.', 'du0u0GfE', '', 'kJOHh0Fb', 'fr'),
(24, 'Pas de PauvretÃ©', '1', '<p>Ã‰radiquer la pauvretÃ© sous toutes ses formes reste un des plus grands dÃ©fis auquel lâ€™humanitÃ© doive faire face. Alors que le nombre de personnes vivant dans lâ€™extrÃªme pauvretÃ© a a baissÃ© rapidement - en 2013, il Ã©tait Ã©gal au tiers de sa valeur de 1990 - d\'aprÃ¨s les derniÃ¨res estimations, 11 % de la population mondiale, soit 783 millions de personnes, vivaient en dessous du seuil dâ€™extrÃªme pauvretÃ© en 2013.</p><p>Dans le monde, le nombre de travailleurs vivant avec leur famille avec moins de 1,90 dollar par personne et par jour a diminuÃ© de faÃ§on sensible au cours des vingt derniÃ¨res an nÃ©es, passant de 26,9 % en 2000 Ã  9,2 % en 2017.</p><p>D\'aprÃ¨s les estimations de 2016, 45 % seulement de la population mondiale bÃ©nÃ©ficiaient d\'un plan efficace de protection sociale avec des prestations en espÃ¨ces</p><p>En 2017, les pertes Ã©conomiques dues Ã  des catastrophes naturelles Ã©taient estimÃ©es Ã  plus de 300 milliards de dollars. Ces pertes, provoquÃ©es par trois puissants ouragans ayant frappÃ© les Ã‰tatsÂ­Unis dâ€™AmÃ©rique et plusieurs pays des CaraÃ¯bes, sont les plus Ã©levÃ©es de ces derniÃ¨res annÃ©es.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'ilffPuEk', 'none', 'aefhMeKu', 'fr'),
(25, 'Faim ZÃ©ro', '2', '<p>Ces vingt derniÃ¨res annÃ©es, la croissance Ã©conomique rapide et une meilleure productivitÃ© agricole ont permis de diviser par prÃ¨s de deux le nombre de personnes sous-alimentÃ©es. De nombreux pays en dÃ©veloppement sont maintenant Ã  mÃªme de rÃ©pondre aux besoins alimentaires des plus vulnÃ©rables. Lâ€™Asie centrale, lâ€™AmÃ©rique latine et les CaraÃ¯bes ont accompli des progrÃ¨s considÃ©rables en vue dâ€™Ã©radiquer la faim extrÃªme.</p><p>Ces progrÃ¨s constituent une rÃ©ussite notable en vue dâ€™atteindre les cibles fixÃ©es par les premiers Objectifs du millÃ©naire pour le dÃ©veloppement. Malheureusement, la faim continue de freiner le dÃ©veloppement de multiples pays. On estimait Ã  795 millions le nombre de personnes chroniquement sous-alimentÃ©es en 2014, Ã  plus de 90 millions le nombre dâ€™enfants de moins de 5 ans souffrant dâ€™une insuffisance pondÃ©rale grave. Et une personne sur quatre souffre encore de la faim en Afrique.</p><p>Les Objectifs de dÃ©veloppement durable visent Ã  mettre un terme Ã  la faim et Ã  la malnutrition sous toutes leurs formes dâ€™ici 2030, en faisant en sorte que toutes les personnes â€“ notamment les enfants et les plus vulnÃ©rables â€“ aient accÃ¨s Ã  une alimentation suffisante en quantitÃ© et en qualitÃ©, tout au long de lâ€™annÃ©e. Cela implique dâ€™encourager des pratiques agricoles durables, d\'amÃ©liorer les moyens dâ€™existence et les capacitÃ©s des petits paysans, de permettre une Ã©galitÃ© dâ€™accÃ¨s Ã  la terre, aux technologies et aux marchÃ©s. Cela implique aussi une coopÃ©ration internationale pour assurer les investissements dans les infrastructures et technologies qui amÃ©liorent la productivitÃ© agricole.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'iCceEFfH', 'none', 'aefhMeKu', 'fr'),
(26, 'GOOD HEALTH AND WELL-BEING', '3', '<p>We have made huge strides in reducing child mortality, improving maternal health and fighting HIV/AIDS, malaria and other diseases. Since 1990, there has been an over 50 percent decline in preventable child deaths globally. Maternal mortality also fell by 45 percent worldwide. New HIV/AIDS infections fell by 30 percent between 2000 and 2013, and over 6.2 million lives were saved from malaria.</p><p>Despite this incredible progress, more than 6 million children still die before their fifth birthday every year. 16,000 children die each day from preventable diseases such as measles and tuberculosis. Every day hundreds of women die during pregnancy or from child-birth related complications. In many rural areas, only 56 percent of births are attended by skilled professionals. AIDS is now the leading cause of death among teenagers in sub-Saharan Africa, a region still severely devastated by the HIV epidemic.</p><p>These deaths can be avoided through prevention and treatment, education, immunization campaigns, and sexual and reproductive healthcare. The Sustainable Development Goals make a bold commitment to end the epidemics of AIDS, tuberculosis, malaria and other communicable diseases by 2030. The aim is to achieve universal health coverage, and provide access to safe and affordable medicines and vaccines for all. Supporting research and development for vaccines is an essential part of this process as well.</p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', '4Flvcvjf', 'none', 'aefhMeKu', 'en'),
(27, 'QUALITY EDUCATION', '4', 'Since 2000, there has been enormous progress in achieving the target of universal primary education. The total enrolment rate in developing regions reached 91 percent in 2015, and the worldwide number of children out of school has dropped by almost half. There has also been a dramatic increase in literacy rates, and many more girls are in school than ever before. These are all remarkable successes.<br><br>Progress has also been tough in some developing regions due to high levels of poverty, armed conflicts and other emergencies. In Western Asia and North Africa, ongoing armed conflict has seen an increase in the number of children out of school. This is a worrying trend. While Sub-Saharan Africa made the greatest progress in primary school enrolment among all developing regions â€“ from 52 percent in 1990, up to 78 percent in 2012 â€“ large disparities still remain. Children from the poorest households are up to four times more likely to be out of school than those of the richest households. Disparities between rural and urban areas also remain high.<br><br>Achieving inclusive and quality education for all reaffirms the belief that education is one of the most powerful and proven vehicles for sustainable development. This goal ensures that all girls and boys complete free primary and secondary schooling by 2030. It also aims to provide equal access to affordable vocational training, to eliminate gender and wealth disparities, and achieve universal access to a quality higher education.<p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'iOhGcvhg', 'none', 'aefhMeKu', 'en'),
(28, 'GENDER EQUALITY', '5', 'Ending all forms of discrimination against women and girls is not only a basic human right, but it also crucial to accelerating sustainable development. It has been proven time and again, that empowering women and girls has a multiplier effect, and helps drive up economic growth and development across the board.<br><br>Since 2000, UNDP, together with our UN partners and the rest of the global community, has made gender equality central to our work. We have seen remarkable progress since then. More girls are now in school compared to 15 years ago, and most regions have reached gender parity in primary education. Women now make up to 41 percent of paid workers outside of agriculture, compared to 35 percent in 1990.<br><br>The SDGs aim to build on these achievements to ensure that there is an end to discrimination against women and girls everywhere. There are still huge inequalities in the labor market in some regions, with women systematically denied equal access to jobs. Sexual violence and exploitation, the unequal division of unpaid care and domestic work, and discrimination in public office, all remain huge barriers.<br><br>Affording women equal rights to economic resources such as land and property are vital targets to realizing this goal. So is ensuring universal access to sexual and reproductive health. Today there are more women in public office than ever before, but encouraging women leaders will help strengthen policies and legislation for greater gender equality.<br><br><span style=\"font-size: 12px;\">Source: UNDP</span><br>', 'yuf8yHnf', 'none', 'aefhMeKu', 'en'),
(29, 'CLEAN WATER AND SANITATION', '6', 'Water scarcity affects more than 40 percent of people around the world, an alarming figure that is projected to increase with the rise of global temperatures as a result of climate change. Although 2.1 billion people have gained access to improved water sanitation since 1990, dwindling supplies of safe drinking water is a major problem impacting every continent.<br><br>In 2011, 41 countries experienced water stress â€“ 10 of which are close to depleting their supply of renewable freshwater and must now rely on alternative sources. Increasing drought and desertification is already worsening these trends. By 2050, it is projected that at least one in four people will be affected by recurring water shortages.<br><br>Ensuring universal access to safe and affordable drinking water for all by 2030 requires we invest in adequate infrastructure, provide sanitation facilities, and encourage hygiene at every level. Protecting and restoring water-related ecosystems such as forests, mountains, wetlands and rivers is essential if we are to mitigate water scarcity. More international cooperation is also needed to encourage water efficiency and support treatment technologies in developing countries.<p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'dhHFSudH', 'none', 'aefhMeKu', 'en'),
(30, 'AFFORDABLE AND CLEAN ENERGY', '7', 'Between 1990 and 2010, the number of people with access to electricity has increased by 1.7 billion, and as the global population continues to rise so will the demand for cheap energy. A global economy reliant on fossil fuels, and the increase of greenhouse gas emissions is creating drastic changes to our climate system. This is impacting every continent.<br><br>Efforts to encourage clean energy has resulted in more than 20 percent of global power being generated by renewable sources as of 2011. Still one in seven people lack access to electricity, and as the demand continues to rise there needs to be a substantial increase in the production of renewable energy across the world.<br><br>Ensuring universal access to affordable electricity by 2030 means investing in clean energy sources such as solar, wind and thermal. Adopting cost-effective standards for a wider range of technologies could also reduce the global electricity consumption by buildings and industry by 14 percent. This means avoiding roughly 1,300 mid-size power plants. Expanding infrastructure and upgrading technology to provide clean energy in all developing countries is a crucial goal that can both encourage growth and help the environment. &nbsp;<br><br><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'uxF2kuuk', 'none', 'aefhMeKu', 'en'),
(31, 'DECENT WORK AND ECONOMIC GROWTH', '8', 'Over the past 25 years the number of workers living in extreme poverty has declined dramatically, despite the lasting impact of the 2008 economic crisis and global recession. In developing countries, the middle class now makes up more than 34 percent of total employment â€“ a number that has almost tripled between 1991 and 2015.<br><br>However, as the global economy continues to recover we are seeing slower growth, widening inequalities, and not enough jobs to keep up with a growing labor force. According to the International Labor Organization, more than 204 million people were unemployed in 2015.<br><br>The SDGs promote sustained economic growth, higher levels of productivity and technological innovation. Encouraging entrepreneurship and job creation are key to this, as are effective measures to eradicate forced labor, slavery and human trafficking. With these targets in mind, the goal is to achieve full and productive employment, and decent work, for all women and men by 2030.<p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'pfPrvuBB', 'none', 'aefhMeKu', 'en'),
(32, 'INDUSTRY, INNOVATION AND INFRASTRUCTURE', '9', 'Investment in infrastructure and innovation are crucial drivers of economic growth and development. With over half the world population now living in cities, mass transport and renewable energy are becoming ever more important, as are the growth of new industries and information and communication technologies.<p><br>Technological progress is also key to finding lasting solutions to both economic and environmental challenges, such as providing new jobs and promoting energy efficiency. Promoting sustainable industries, and investing in scientific research and innovation, are all important ways to facilitate sustainable development.<br><br></p><p>More than 4 billion people still do not have access to the Internet, and 90 percent are from the developing world. Bridging this digital divide is crucial to ensure equal access to information and knowledge, as well as foster innovation and entrepreneurship.</p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'Cjivbhpu', 'none', 'aefhMeKu', 'en'),
(33, 'REDUCED INEQUALITIES', '10', '<p>It is well documented that income inequality is on the rise, with the richest 10 percent earning up to 40 percent of total global income. The poorest 10 percent earn only between 2 percent and 7 percent of total global income. In developing countries, inequality has increased by 11 percent if we take into account the growth of population.</p><p>These widening disparities require the adoption of sound policies to empower the bottom percentile of income earners, and promote economic inclusion of all regardless of sex, race or ethnicity.</p><p>Income inequality is a global problem that requires global solutions. This involves improving the regulation and monitoring of financial markets and institutions, encouraging development assistance and foreign direct investment to regions where the need is greatest. Facilitating the safe migration and mobility of people is also key to bridging the widening divide.</p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p><p><br></p>', 'NjVNcxhM', 'none', 'aefhMeKu', 'en'),
(34, 'SUSTAINABLE CITIES AND COMMUNITIES', '11', '<p>More than half of the worldâ€™s population now live in urban areas. By 2050, that figure will have risen to 6.5 billion people â€“ two-thirds of all humanity. Sustainable development cannot be achieved without significantly transforming the way we build and manage our urban spaces.</p><p>The rapid growth of cities in the developing world, coupled with increasing rural to urban migration, has led to a boom in mega-cities. In 1990, there were ten mega-cities with 10 million inhabitants or more. In 2014, there are 28 mega-cities, home to a total 453 million people.</p><p>Extreme poverty is often concentrated in urban spaces, and national and city governments struggle to accommodate the rising population in these areas. Making cities safe and sustainable means ensuring access to safe and affordable housing, and upgrading slum settlements. It also involves investment in public transport, creating green public spaces, and improving urban planning and management in a way that is both participatory and inclusive.</p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', '8c4Hygvy', 'none', 'aefhMeKu', 'en'),
(35, 'RESPONSIBLE CONSUMPTION AND PRODUCTION', '12', 'Achieving economic growth and sustainable development requires that we urgently reduce our ecological footprint by changing the way we produce and consume goods and resources. Agriculture is the biggest user of water worldwide, and irrigation now claims close to 70 percent of all freshwater for human use.<br><br>The efficient management of our shared natural resources, and the way we dispose of toxic waste and pollutants, are important targets to achieve this goal. Encouraging industries, businesses and consumers to recycle and reduce waste is equally important, as is supporting developing countries to move towards more sustainable patterns of consumption by 2030.<br><br>A large share of the world population is still consuming far too little to meet even their basic needs.&nbsp; Halving the per capita of global food waste at the retailer and consumer levels is also important for creating more efficient production and supply chains. This can help with food security, and shift us towards a more resource efficient economy.<p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'p7fHcrir', 'none', 'aefhMeKu', 'en'),
(36, 'Climate Action', '13', '<p>There is no country in the world that is not experiencing first-hand the drastic effects of climate change. Greenhouse gas emissions continue to rise, and are now more than 50 percent higher than their 1990 level. Further, global warming is causing long-lasting changes to our climate system, which threatens irreversible consequences if we do not take action now.</p><p>The annual average losses from tsunamis, tropical cyclones and flooding amount to hundreds of billions of dollars, requiring an investment of US$6 billion annually in disaster risk manage mentalone. The goal aims to mobilize $100 billion annually by 2020 to address the needs of developing countries and help mitigate climate-related disasters.</p><p>Helping more vulnerable regions, such as land locked countries and island states, adapt to climate change must go hand in hand with efforts to integrate disaster risk measures into national strategies. It is still possible, with the political will and a wide array of technological measures, to limit the increase in global mean temperature to two degrees Celsius above pre-industrial levels. This requires urgent collective action.</p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'OljJiVJN', 'none', 'aefhMeKu', 'en'),
(37, 'LIFE BELOW WATER', '14', 'The worldâ€™s oceans â€“ their temperature, chemistry, currents and life â€“ drive global systems that make the Earth habitable for humankind. How we manage this vital resource is essential for humanity as a whole, and to counter balance the effects of climate change.<br><br>Over three billion people depend on marine and coastal biodiversity for their livelihoods. However, today we are seeing 30 percent of the worldâ€™s fish stocks overexploited, reaching below the level at which they can produce sustainable yields.<br><br>Oceans also absorb about 30 percent of the carbon dioxide produced by humans, and we are seeing a 26 percent rise in ocean acidification since the beginning of the industrial revolution. Marine pollution, an overwhelming majority of which comes from land-based sources, is reaching alarming levels, with an average of 13,000 pieces of plastic litter to be found on every square kilometer of ocean.<br><br>The SDGs aim to sustainably manage and protect marine and coastal ecosystems from pollution, as well as address the impacts of ocean acidification. Enhancing conservation and the sustainable use of ocean-based resources through international law will also help mitigate some of the challenges facing our oceans.<br><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'j0Ou0Kuk', 'none', 'aefhMeKu', 'en'),
(38, 'LIFE ON LAND', '15', '<p>Human life depends on the earth as much as the ocean for our sustenance and livelihoods. Plant life provides 80 percent of our human diet, and we rely on agriculture as an important economic resource and means of development. Forests account for 30 percent of the Earthâ€™s surface, providing vital habitats for millions of species and important sources for clean air and water; as well as being crucial for combating climate change.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>Today we are seeing unprecedented land degradation, and the loss of arable land at 30 to 35 times the historical rate. Drought and desertification is also on the rise each year, amounting to the loss of 12 million hectares and affects poor communities globally. Of the 8,300 animal breeds known, 8 percent are extinct and 22 percent are at risk of extinction.</p><p>The SDGs aim to conserve and restore the use of terrestrial ecosystems such as forests, wetlands, drylands and mountains by 2020. Halting deforestation is also vital to mitigating the impact of climate change. Urgent action must be taken to reduce the loss of natural habitats and biodiversity which are part of our common heritage.</p><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'xOudHrFF', 'none', 'aefhMeKu', 'en'),
(39, 'PEACE, JUSTICE AND STRONG INSTITUTIONS', '16', 'Without peace, stability, human rights and effective governance, based on the rule of law - we cannot hope for sustainable development. We are living in a world that is increasingly divided. Some regions enjoy sustained levels of peace, security and prosperity, while others fall into seemingly endless cycles of conflict and violence. This is by no means inevitable and must be addressed.<br><br>High levels of armed violence and insecurity have a destructive impact on a countryâ€™s development, affecting economic growth and often resulting in long standing grievances that can last for generations. Sexual violence, crime, exploitation and torture are also prevalent where there is conflict or no rule of law, and countries must take measures to protect those who are most at risk.<br><br>The SDGs aim to significantly reduce all forms of violence, and work with governments and communities to find lasting solutions to conflict and insecurity. Strengthening the rule of law and promoting human rights is key to this process, as is reducing the flow of illicit arms and strengthening the participation of developing countries in the institutions of global governance.<p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br><br></p>', 'nvyM8x4O', 'none', 'aefhMeKu', 'en'),
(40, 'PARTNERSHIPS FOR THE GOALS', '17', 'The SDGs can only be realized with a strong commitment to global partnership and cooperation. While official development assistance from developed countries increased by 66 percent between 2000 and 2014, humanitarian crises brought on by conflict or natural disasters continue to demand more financial resources and aid. Many countries also require Official Development Assistance to encourage growth and trade. &nbsp;<br><br>The world today is more interconnected than ever before. Improving access to technology and knowledge is an important way to share ideas and foster innovation. Coordinating policies to help developing countries manage their debt, as well as promoting investment for the least developed, is vital to achieve sustainable growth and development.<br><br>The goals aim to enhance North-South and South-South cooperation by supporting national plans to achieve all the targets. Promoting international trade, and helping developing countries increase their exports, is all part of achieving a universal rules-based and equitable trading system that is fair and open, and benefits all.<br><p><br></p><p><span style=\"font-size: 12px;\">Source: UNDP</span><br></p>', 'SySObih7', 'none', 'aefhMeKu', 'en'),
(41, 'Motivation', 'none', 'Q: What are the Sustainable Development Goals (SDGs)?<br><br>A: The 17 SDGs are universal goals that were adopted by all member states of the United Nations in 2015 to guide international collaboration towards sustainable development. They follow the Millennium Development Goals, and aim to end poverty, tackle inequality, protect the planet, promote peace, and ensure prosperity for all. Each goal has specific targets to be achieved before 2030. See the UN website for more information about the SDGs.<br><br>Q: Why develop an Africa SDG Index and Dashboards?<br><br>A: More than any other region in the world, Africa faces substantial challenges in achieving the SDGs. The 2018 Africa SDG Index and Dashboards present an analysis of African countriesâ€™ current situation towards achieving the SDGs. The Africa SDG Index aggregates available data on all SDGs into a composite index to provide African countries with a quick assessment of how they are performing relative to their peers. As a benchmarking tool, the Africa SDG Index and Dashboards can support national discussions on operationalizing the SDGs and guide national policies and long-term strategies for sustainable development.<p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\">Overall, according to this Dashboard, the goal areas facing the steepest challenges are health (SDG 3), infrastructure (SDG 9), and peace,justice, and strong institutions (SDG 16) with more than 80% of countries scoring red. Food security and sustainable agriculture (SDG 2), energy access(SDG 7), and marine ecosystems (SDG 14) are also big challenges that need to be prioritized as around 70% of the countries scored red in these areas. For 14 ofthe 17 goals, not a single African country has achieved green status, according to the Dashboardâ€™s system of color-coding. For the remaining three goals, there are only a handful of green countriesâ€”climate action (SDG 13) has five greens,and terrestrial ecosystems (SDG 15) and sustainable consumption and production(SDG 12) have three and two greens, respectively.</p><br>Q: Do the Africa SDG Index and Dashboards replace or compete with official SDG monitoring?<br><br>A: No. The Africa SDG Index and Dashboards are preliminary analytical tools to help governments and other stakeholders take stock of where they currently stand with regards to achieving the SDGs and to identify priorities for early action. As new data become available they will be included in the Africa SDG Index and Dashboards, which will be published on an annual basis for the next three years. Simultaneously, countries will need to develop a full suite of monitoring systems to track the SDG metrics recommended by the UN Statistical Commission. This will require major investments in statistical capacity development, particularly in poorer countries or those with low statistical capacity. Over time every country should be able to track critical SDG variables to monitor progress towards achieving the goals.<br><br>', 'VpOSrr8r', 'none', 'd4hVSHOj', 'en'),
(42, 'Country coverage and indicator selection', 'none', 'Q: How have indicators been selected for the Africa Index and Dashboards? Why are they not identical to the proposed official SDG Indicators?<br><br>A: In early 2016, the UN Statistical Commission recommended several indicators for measuring the progress towards the SDGs, which in April 2017 reached 232 indicators and was endorsed by the UN Statistical Commission. Yet for most countries data remain unavailable for the vast majority of these proposed indicators. It will take time and investments in statistical capacity to build up national data systems so that every country can monitor progress against the official indicators. Meanwhile, countries need to start the process of operationalizing and implementing the SDGs using data available today.<br><br>The Africa SDG Index was built on a set of indicators for each of the 17 SDGs using the most recent published data. We considered each of the 232 SDG indicators proposed by the Inter-Agency and Expert Group on SDG Indicators and endorsed by the UN Statistical Commission, and included those that met five criteria. Some official SDG indicators met the five criteria but could not be included as they did not permit a ranking of countries or the definition of a quantitative threshold signifying achievement of the goals applicable to all countries. For example, different countries specialize in different sectors of the economy, so there is no â€œrightâ€ threshold of manufacturing as a share of GDP for which all countries should aim.&nbsp;<p><br></p><p>Where official SDG indicators did not meet the criteria for data selection or where indicator gaps remained, we considered official and other metrics published in peer-reviewed literature, as well as major databases and reports on development and environmental indicators. Owing to limited data availability and a lack of metrics for key SDG priorities, particularly education and inequality, this report is still an incomplete picture. As data availability improves and new estimation techniques become available, subsequent editions of the Africa SDG Index and Dashboard may include additional variables.<br><br>For this first edition, we included 97 indicators from a broad range of data sources, 28 of which are Africa-specific, including indicators from the A2063 ten-year implementation plan. The revised set of indicators includes new indicators and revisions to fill gaps and to better align the SDG Index and Dashboards with the monitoring needs of African states. The Africa SDG Index comprises 51 of the 54 African member states of the UN.<br><br>Q: Why are some countries not included in the Africa SDG Index?<br><br>A: A country is included in the Africa SDG Index if it has data for at least 80% of the indicators. Some countries with a population of less than one million have sufficient data and are therefore included in the Africa SDG Index, despite the indicator selection criteria of 80% data availability in countries with a population above one million. The fact that some countries lack sufficient data for inclusion in the Africa SDG Index underscores the need for greater investments in statistical capacity building.<br><br>Q.: Where do the data for the Africa SDG Index and Dashboards come from?<br><br>A: To the greatest extent possible, the Africa SDG Index and Dashboards rely on internationally comparable official statistics. In order to fill in some gaps in the official data, non-official metrics from other reputable sources have been used, as described in the online metadata. Data for each indicator have been rigorously selected and reviewed for quality, timeliness and verifiability.<br><br></p>', 'O8Oux3Fy', 'none', 'd4hVSHOj', 'en');
INSERT INTO `mvc_article` (`id`, `title`, `subtitle`, `content`, `article_index`, `logo`, `section_index`, `lang`) VALUES
(43, 'Methodology', 'none', 'Q: How do the Index and Dashboards compare performance across different indicators?<br><br>A: To ensure comparability we normalize the data for each indicator by transforming it linearly into a scale from 0 to 100. A value of 100 denotes the technical optimum, while a value of zero denotes the 2.5th percentile in the distribution. For clarity and ease of interpretation, we transform some indicators so that in each case a higher score on the normalized indicator corresponds to a higher overall progress.<br><br>Q: How are the SDGs and the indicators weighted?<br><br>A: Each SDG has the same weight in the Index and Dashboards, which is in line with the spirit of the SDGs. This implies that countries need to pursue all 17 goals through integrated strategies. Within each goal every indicator is equally weighted, which implies that every indicator is weighted inversely to the number of indicators available for that particular SDG. An advantage of this approach is that as more and better data become available, new variables can easily be added to individual SDGs without changing the relative weighting of the goals. In this way the Africa SDG Index and Dashboards can evolve over time as each epistemic community generates new and better data.<br><br>Q: How to interpret the Africa SDG Dashboards?<br><br>A: Some other indices use relative performance across countries to define thresholds. We believe that absolute thresholds are more suitable since most SDGs require absolute benchmarks to be achieved. To assess a countryâ€™s progress on a particular indicator, such absolute quantitative thresholds are introduced to differentiate between situations where an SDG threshold has been met (green), where significant challenges remain (yellow &amp; orange), and where major challenges must be overcome if the country is to meet the goal (red). Where possible, these thresholds are derived from the SDGs, their targets, or other official sources. All thresholds are specified in the online metadata.<br><br>Q: How are the Africa SDG Index and Dashboards scores calculated and what aggregation method is used?<br><br>A: The choice of aggregation formula can have important implications for the results of both the Africa SDG Index and Dashboards. Taking a simple average of indicator values (arithmetic aggregation) implies that the indicators are perfectly substitutable: progress on one variable can offset lack of progress on another. This approach is reasonable for indicators within the same goal that tend to complement one another, so we use arithmetic means to aggregate indicators within each SDG for the Index and Dashboards.<br><br>However, major trade-offs may occur across SDGs. Progress on one goal (e.g. higher economic growth) cannot fully offset lack of progress on another (e.g. rising inequality or environmental degradation). For this reason countries need to make progress towards every goal. In other words, one must assume limited substitutability across goals, which is commonly done by using the geometric mean. As a result, one could argue for using the geometric average of the scores for each SDG to compute the overall Africa SDG Index.<br><br>Nevertheless, the two methods of aggregation give almost the same rankings and nearly the same scores for most countries. For simplicity, we therefore use the arithmetic aggregation even though the geometric aggregation is conceptually attractive. This leaves a natural interpretation of the meaning of the national Africa SDG Index score. An Africa SDG Index value (e.g. 66) therefore means that the country is a certain percentage (e.g. 66%) of the way from the worst to the best score on average across the 17 SDGs.<br><br>A third method for aggregating indicator scores is the Leontief minimum function, which ascribes the value of the indicator on which the country performs worst as the score for the SDG. This aggregation is helpful for identifying the areas within each goal where a country needs to make the greatest progress but is too â€œtoughâ€ an approach to allow comparison of countries.<br><br>For the Africa SDG Dashboards, we use the average of the two worst performing indicators to assign colors to SDGs. To score â€œredâ€, both worst performing indicators must be â€œredâ€. To achieve â€œgreenâ€, all indicators under the goal must be â€œgreenâ€. If the average rating falls in the â€œcaution laneâ€, the SDG is assigned â€œyellowâ€ or â€œorangeâ€, depending on how far along the country is on the path from â€œredâ€ to â€œgreen.â€<br><br>Q: How do the Africa SDG Index and Dashboards deal with missing data?<br><br>A: The Africa SDG Index and Dashboards do not model or extrapolate data at the indicator level to fill gaps because such extrapolations are prone to errors. However, for the purposes of calculating countriesâ€™ total index scores, we impute average regional goal scores for those countries that have no data under a goal. This applies primarily to goal 10 (Reduced Inequalities) and goal 14 (Life Below Water). Still, they are presented as missing data in the country profiles. At this stage in the implementation of the SDGs we also want to highlight data gaps so as to encourage governments and the international system to fill them. There are few exceptions where data were imputed for entire groups of countries (sub regions).<br><br>Q: How do you estimate trends?<br><br>Using historic data, we estimate how fast a country has been progressing towards an SDG and determine whether â€“ if continued into the future â€“ this pace will be sufficient to achieve the SDG by 2030. For each indicator, SDG achievement is defined by the green threshold set for the Africa SDG Dashboards. The difference in percentage points between the green threshold and the normalized country score denotes the gap that must be closed to meet that goal. To estimate SDG trends, we calculated the linear annual growth rates (i.e. annual percentage improvements) needed to achieve the goal by 2030 (i.e. 2010-2030) which we compared to the average annual growth rate over the most recent period (usually 2010-2015). Progress towards goal achievement on a particular indicator is described using a 5-arrow system.<br><br>To estimate overall trends for an SDG, each indicator trend for that SDG was re-normalized on a linear scale from 0-4. The trend for an SDG was calculated as the arithmetic average of all trend indicators for that goal. An average between 0-1 corresponds to a â€œdecreasingâ€ goal trend, between 1-2 to a â€œstagnatingâ€ goal trend, 2-3 â€œmoderately improving goal trendâ€, 3-4 â€œon trackâ€ goal trend. Maintaining SDG achievement corresponds to a normalized score of exactly 3. Trends are reported at the SDG level only if trend data were available for at least 75% of Africa SDG Dashboards indicators under that goal. SDG Trends are based on data points that precede the adoption of SDGs, because data is reported with long lags at the international level due to lengthy validation processes. Over time, we will update the data to use 2015 as baseline year for SDG Trends.<br><br>Trends indicators were selected from among the indicators included in the Africa SDG Dashboards based on the availability of trend data. When the value for one year was not available we used the closest available value with a maximum of one-year difference.<br><br>Several other calculation methods were considered. For instance, we tested the sensitivity of the results when using technical optimums (100 score) as â€œgoal achievementâ€ and calculate distance to technical optimums. This approach yielded harsher results and is not consistent with our conceptual assumption that lower green thresholds correspond to goal achievement. We also considered using compound annual growth rates (CAGR) instead of linear growth rates. The two approaches yield rather similar results and we could not identify a strong argument for using the more sophisticated CAGR method. Finally, while the dashboards are based only on the two-worst indicators trends are generated using all indicators under the goal. This is because the dashboards aim to highlight goals where particular attention is required due to very poor performance on some of the underlying indicators whereas trends aim to reflect insights on the overall goal evolution including all indicators.<br><br>Q: How does the trend analysis deal with countries that have already met a SDG target?<br><br>A: Our methodology ignores movements (both positive and negative) which are above goal achievement (the green threshold). Conceptually, our objective is to show how much countries are progressing towards reaching the goals. Therefore, a country above the green threshold and that maintained its performance above the green threshold is automatically considered as having maintained performance above goal achievement. At the goal level, this arrow is only given when all of a countriesâ€™ trend indicators have maintained performance above their respective green thresholds.<br><br>', '4wMlbOVK', 'none', 'd4hVSHOj', 'en'),
(44, 'Interpreting the results and limitations', 'none', 'Q: Morocco is ranked number 1 in the Africa SDG Index. Does this mean the country has achieved all the SDGs?<br><br>A: Absolutely not. While Morocco performs best on average based on the data we were able to mobilize for the Africa SDG Index. The Africa SDG Dashboards makes clear that every country faces major challenges in achieving the SDGs. This applies equally to Morocco and other top-ranking countries.<br><br>Q: How does the Africa SDG Index relate to other development indices for the SDGs?<br><br>A: Many other composite development indices exist, but we are not aware of one tracking all 17 SDGs at the country level. In 2015, the Bertelsmann Stiftung issued a report, which was the first to develop an index for OECD countries to track SDG achievement and determine priorities for implementation in each country. Another significant effort has been undertaken by the Overseas Development Institute, which presents a regional SDG Scorecard, projecting trends across key dimensions of the SDGs to determine areas in which the fastest acceleration of progress will be required. The Africa SDG Index and Dashboards, however, provides a comprehensive global index to track the implementation of the SDGs.<br><br>Q: How can I access the data for my country or region?<br><br>A: Country profiles and data are available for download in this website. The data will be updated each year.<br><br>Q: What are the major data limitations?<br><br><p>To ensure maximum data comparability we only use data from internationally comparable sources, the report relies to on data validated and published by international organizations and other providers who may adjust national data to ensure international comparability. As a result, some data points presented in this report may be different from data available from national statistical offices. Moreover, the length of the validation processes by international organizations can lead to significant delays in publishing more updated data. As a result, national statistical offices may have more recent data for certain indicators. Additionally, it is important to note that the results each year is not completely reflective of the year of publication as the results are based on the most available data.&nbsp;</p><p>Moreover, the limitations that traditionally apply to any composite index also applies here. It is not a perfect tool; however, it is a tool that strives to provide a snapshot of how Africa is progressing toward in the SDGs in a space where such a tool does not currently exist.</p><p>Finally, the reported SDG Trends are based on data points that precede the adoption of SDGs but data are reported with long lags at the international level due to lengthy validation processes. Over time, we will update the data to use 2015 as baseline year for SDG Trends. In future editions we will aim to include additional and improved SDG metrics while aiming for greater comparability over time.</p><p><br></p><p>Q: When will the Africa SDG Index and Dashboards be updated?<br></p><br>A: The Africa SDG Index and Dashboards will be updated annually to include new indicators as they become available, update the data, and incorporate suggestions on how to make the tools more useful for countries and other stakeholders. The website will be continuously improved to facilitate the real-time use of the data and comparisons across countries.<br><br>', 'MffJO8rN', 'none', 'd4hVSHOj', 'en'),
(45, 'Contacts', 'none', 'Q: To whom can I address my comments on the Africa SDG Index and Dashboards?<br><br><p>A: We welcome comments and suggestions for improving the Africa SDG Index and Dashboards. Please address your comments and suggestions to africasdgindex@sdgcafrica.org or africa@sdgindex.org.</p><p><br></p>', 'i8OOca0f', 'none', 'd4hVSHOj', 'en'),
(47, 'Bonne santÃ© et bien-etre', '3', '<p>Depuis la crÃ©ation des Objectifs du millÃ©naire pour le dÃ©veloppement, des avancÃ©es historiques ont Ã©tÃ© rÃ©alisÃ©es en termes de rÃ©duction de la mortalitÃ© infantile, dâ€™amÃ©lioration de la santÃ© maternelle et de lutte contre le VIH/sida, le paludisme et dâ€™autres maladies. Depuis 2000, le taux de mortalitÃ© des enfants de moins de 5 ans a chutÃ© de 47%. La mortalitÃ© maternelle a Ã©galement chutÃ© de 37%. Au niveau mondial, lâ€™incidence du VIH a diminuÃ© de 0,40 Ã  0,26 pour 1 000 personnes non infectÃ©es entre 2005 et 2016.</p><p>En dÃ©pit de ces incroyables progrÃ¨s, l\'eau insalubre, des systÃ¨mes d\'assainissement dÃ©ficients et le manque dâ€™hygiÃ¨ne restent les principaux facteurs de la mortalitÃ© mondiale, provoquant la mort d\'environ 870 000 personnes en 2016.</p><p>Ces morts peuvent Ãªtre Ã©vitÃ©es grÃ¢ce Ã  la prÃ©vention et au traitement, Ã  lâ€™Ã©ducation, aux campagnes dâ€™immunisation et aux soins mÃ©dicaux. Les Objectifs de dÃ©veloppement durable sâ€™engagent audacieusement Ã  enrayer lâ€™Ã©pidÃ©mie de sida, la tuberculose, le paludisme et dâ€™autres maladies transmissibles dâ€™ici 2030. Le but visÃ© est que chacun dispose dâ€™une couverture maladie universelle et ait accÃ¨s Ã  des vaccins et mÃ©dicaments sÃ»rs et efficaces. Ã€ ce titre, le soutien Ã  la recherche et au dÃ©veloppement dans le domaine des vaccins est essentiel, de mÃªme que lâ€™accÃ¨s aux mÃ©dicaments Ã  un coÃ»t abordable.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', '4Flvcvjf', 'none', 'aefhMeKu', 'fr'),
(48, 'Ã‰ducattion de quaritÃ©', '4', '<p>Depuis 2000, des progrÃ¨s considÃ©rables ont Ã©tÃ© accomplis en vue dâ€™atteindre la cible dâ€™Ã©ducation primaire universelle. Le taux de scolarisation global dans les rÃ©gions en dÃ©veloppement a atteint 91 % en 2015, et le nombre dâ€™enfants non scolarisÃ©s au niveau mondial a chutÃ© de presque moitiÃ©. On constate Ã©galement une augmentation spectaculaire du taux dâ€™alphabÃ©tisation, et le taux de scolarisation des filles nâ€™a jamais Ã©tÃ© aussi Ã©levÃ©.</p><p>Mais ces succÃ¨s se heurtent Ã  de grands dÃ©fis dans des rÃ©gions en dÃ©veloppement, en raison du niveau Ã©levÃ© de pauvretÃ©, des conflits armÃ©s et dâ€™autres urgences. Alors que lâ€™Afrique sub-saharienne a rÃ©alisÃ© les progrÃ¨s les plus importants parmi toutes les rÃ©gions en dÃ©veloppement sur le plan du taux de scolarisation dans lâ€™enseignement primaire â€“ passÃ© de 52 % en 1990 Ã  78 % en 2012 â€“ de grandes disparitÃ©s subsistent. Les enfants des foyers les plus dÃ©favorisÃ©s sont quatre fois moins scolarisÃ©s que ceux des foyers les plus riches. De mÃªme, les disparitÃ©s entre les zones rurales et urbaines demeurent.</p><p>Une Ã©ducation de qualitÃ© pour tous est lâ€™un des piliers les plus solides et Ã©prouvÃ©s du dÃ©veloppement durable. Cet objectif fait en sorte que toutes les filles et tous les garÃ§ons suivent un cycle complet dâ€™enseignement primaire et secondaire gratuit dâ€™ici 2030. Il vise Ã©galement Ã  donner accÃ¨s, dans des conditions dâ€™Ã©galitÃ©, Ã  un enseignement professionnel, ainsi quâ€™Ã  Ã©liminer les inÃ©galitÃ©s entre les sexes et les revenus, dans le but de permettre Ã  tous dâ€™accÃ©der Ã  des Ã©tudes supÃ©rieures.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'iOhGcvhg', 'none', 'aefhMeKu', 'fr'),
(49, 'Ã‰galitÃ© entre les sexes', '5', '<p>Autonomiser les femmes et promouvoir lâ€™Ã©galitÃ© entre les sexes est dÃ©terminant pour accÃ©lÃ©rer le dÃ©veloppement durable. Mettre fin Ã  toutes les formes de discrimination envers les femmes et les filles constitue un droit humain fondamental, qui se rÃ©percute positivement sur tous les autres domaines de dÃ©veloppement.</p><p>Depuis 2000, le PNUD a fait de lâ€™Ã©galitÃ© des sexes une de ses prioritÃ©s et des progrÃ¨s remarquables ont Ã©tÃ© accomplis. En 15 ans, la scolarisation des filles a progressÃ© et la plupart des rÃ©gions sont parvenues Ã  une paritÃ© filles-garÃ§ons dans lâ€™enseignement primaire. Les femmes reprÃ©sentent dÃ©sormais 41 % des travailleurs rÃ©munÃ©rÃ©s hors agriculture, contre 35 % en 1990.</p><p>Les Objectifs de dÃ©veloppement durable sâ€™appuient sur ces succÃ¨s pour faire en sorte dâ€™abolir la discrimination Ã  lâ€™Ã©gard des femmes et des filles dans le monde entier. Des inÃ©galitÃ©s criantes perdurent en matiÃ¨re dâ€™accÃ¨s Ã  lâ€™emploi rÃ©munÃ©rÃ© dans certaines rÃ©gions, de mÃªme quâ€™un profond fossÃ© entre les hommes et les femmes sur le marchÃ© du travail. Lâ€™exploitation et la violence sexuelles, la rÃ©partition inÃ©gale du travail domestique et des tÃ¢ches non rÃ©munÃ©rÃ©es, ainsi que la discrimination dans la prise de dÃ©cisions publiques, constituent encore des obstacles de taille.</p><p>Rendre accessibles Ã  tous les soins de santÃ© en matiÃ¨re de sexualitÃ© et de procrÃ©ation, ainsi que donner aux femmes le droit aux mÃªmes ressources Ã©conomiques telles que les terres et la propriÃ©tÃ©, sont des cibles primordiales pour rÃ©aliser cet objectif. Les femmes sont dÃ©sormais plus nombreuses que jamais dans la fonction publique, mais encourager lâ€™occupation des postes de direction par des femmes dans toutes les rÃ©gions contribuera Ã  renforcer les politiques et les lois en faveur dâ€™une plus grande Ã©galitÃ© hommes-femmes.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'yuf8yHnf', 'none', 'aefhMeKu', 'fr'),
(50, 'Eau Propre Et Assainissement', '6', '<p>La rarÃ©faction de lâ€™eau affecte plus de 40 % de la population mondiale, une proportion inquiÃ©tante qui risque de sâ€™aggraver en raison de la hausse des tempÃ©ratures mondiales due au changement climatique. Depuis 1990, 2,1 milliards de personnes supplÃ©mentaires bÃ©nÃ©ficient dÃ©sormais dâ€™un meilleur accÃ¨s Ã  l\'eau et Ã  l\'assainissement. Cependant, lâ€™Ã©puisement des ressources en eau potable reste un problÃ¨me majeur touchant tous les continents.</p><p>Faire en sorte dâ€™assurer dâ€™ici Ã  2030 un accÃ¨s universel et Ã©quitable Ã  lâ€™eau potable, Ã  un coÃ»t abordable, implique dâ€™investir dans des infrastructures adÃ©quates, de fournir des installations dâ€™assainissement et de promouvoir lâ€™hygiÃ¨ne Ã  tous les niveaux. ProtÃ©ger et restaurer les Ã©cosystÃ¨mes liÃ©s Ã  lâ€™eau, notamment les forÃªts, les montagnes, les zones humides et les riviÃ¨res, est essentiel si nous voulons limiter la rarÃ©faction de lâ€™eau. Renforcer la coopÃ©ration internationale est Ã©galement nÃ©cessaire pour encourager une utilisation rationnelle de lâ€™eau et soutenir les technologies de traitement des eaux dans les pays en dÃ©veloppement.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'dhHFSudH', 'none', 'aefhMeKu', 'fr'),
(51, ' Ã©nergie propre et d\'un cout abordable', '7', '<p>Entre 1990 et 2010, le nombre de personnes disposant de lâ€™Ã©lectricitÃ© a augmentÃ© d\'1,7 milliard. Cependant, une personne sur cinq est toujours privÃ©e dâ€™Ã©lectricitÃ© et comme la demande ne cesse dâ€™augmenter, il convient dâ€™accroÃ®tre nettement la production dâ€™Ã©nergie renouvelable dans le monde.</p><p>On constate une volontÃ© nouvelle dâ€™encourager les Ã©nergies alternatives, et en 2011 celles-ci reprÃ©sentaient plus de 20 % de la consommation mondiale. Desservir chaque foyer en Ã©lectricitÃ© Ã  un coÃ»t abordable dâ€™ici 2030 implique dâ€™investir dans des sources dâ€™Ã©nergie propre telle que lâ€™Ã©nergie photovoltaÃ¯que, Ã©olienne et gÃ©othermique. Lâ€™adoption de normes rentables concernant un large Ã©ventail de technologies pourrait aussi rÃ©duire la consommation Ã©lectrique mondiale des bÃ¢timents et de lâ€™industrie de 14 %. Cela Ã©quivaut Ã  la fermeture de quelque 1300 centrales Ã©lectriques de taille moyenne. DÃ©velopper lâ€™infrastructure et perfectionner les technologies afin dâ€™approvisionner en Ã©nergie propre tous les pays en dÃ©veloppement est un objectif capital, permettant de soutenir la croissance tout en agissant positivement sur lâ€™environnement.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'uxF2kuuk', 'none', 'aefhMeKu', 'fr'),
(52, 'travail dÃ©cent et croissance Ã©conomique', '8', '<p>Ces 25 derniÃ¨res annÃ©es, le nombre de travailleurs vivant dans lâ€™extrÃªme pauvretÃ© a connu un dÃ©clin spectaculaire. Dans les pays en dÃ©veloppement, la classe moyenne reprÃ©sente dÃ©sormais plus de 34 % du total des personnes employÃ©es â€“ une proportion qui a presque triplÃ© entre 1991 et 2015.</p><p>Pourtant, alors que la reprise Ã©conomique mondiale se poursuit, nous constatons un ralentissement de la croissance, un creusement des inÃ©galitÃ©s une augmentation de la population active plus rapide que celle des offres sur le marchÃ© de lâ€™emploi. Selon lâ€™Organisation internationale du Travail, on recense plus de 204 millions de chÃ´meurs en 2015.</p><p>Les Objectifs de dÃ©veloppement durable visent Ã  encourager une croissance Ã©conomie soutenue en tirant la productivitÃ© vers le haut et en innovant sur le plan technologique. Ã€ ce titre, il est dÃ©terminant de promouvoir des politiques qui favorisent lâ€™entreprenariat et la crÃ©ation dâ€™emplois, de mÃªme que des mesures efficaces pour abolir le travail forcÃ©, lâ€™esclavage et la traite des humains. Pour ce qui est de ces cibles, lâ€™objectif consiste Ã  parvenir au plein emploi productif et au travail dÃ©cent, pour tous les hommes et les femmes, dâ€™ici 2030.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'pfPrvuBB', 'none', 'aefhMeKu', 'fr'),
(53, 'industrie, innovation et infrastructure ', '9', '<p>Investir durablement dans les infrastructures et lâ€™innovation est un vecteur clÃ© de croissance Ã©conomique et de dÃ©veloppement. Avec plus de la moitiÃ© de la population mondiale qui vit dÃ©sormais dans les villes, les transports publics et les Ã©nergies renouvelables deviennent de plus en plus importants, de mÃªme que la croissance des nouvelles industries et des technologies de lâ€™information et de la communication.</p><p>Les progrÃ¨s technologiques permettent en outre de mettre au point des solutions durables aux dÃ©fis, tant Ã©conomiques quâ€™Ã©cologiques, tels que la crÃ©ation dâ€™emplois et la promotion de lâ€™efficacitÃ© Ã©nergÃ©tique. Favoriser une industrie durable, ainsi quâ€™investir dans la recherche et lâ€™innovation scientifiques, constituent deux moyens importants pour faciliter le dÃ©veloppement durable.</p><p>Plus de 4 milliards de personnes nâ€™ont toujours pas accÃ¨s Ã  Internet et parmi elles, 90 % appartiennent aux pays en dÃ©veloppement. Combler ce fossÃ© numÃ©rique est crucial si lâ€™on veut donner accÃ¨s, dans des conditions dâ€™Ã©galitÃ©, Ã  lâ€™information et au savoir, et par lÃ  mÃªme encourager lâ€™innovation et lâ€™entreprenariat.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'Cjivbhpu', 'none', 'aefhMeKu', 'fr'),
(54, 'inÃ©galitÃ©s rÃ©duites', '10', '<p>Il est bien Ã©tabli que les inÃ©galitÃ©s de revenus se creusent : 10 % des personnes les plus riches perÃ§oivent prÃ¨s de 40 % du total des revenus mondiaux, tandis que les 10 % plus pauvres ne gagnent quâ€™entre 2 Ã  7 % du total des revenus mondiaux. Dans les pays en dÃ©veloppement, les inÃ©galitÃ©s se sont creusÃ©es de 11 % en tenant compte de la croissance de la population.</p><p>Ces disparitÃ©s grandissantes sont des appels Ã  lâ€™action, impliquant dâ€™adopter des mesures saines afin dâ€™autonomiser la tranche infÃ©rieure de la population touchant un revenu et de favoriser lâ€™intÃ©gration Ã©conomique de tous, indÃ©pendamment de leur sexe, de leur race ou de leur appartenance ethnique.</p><p>Les inÃ©galitÃ©s de revenu sont un problÃ¨me global qui appelle des solutions mondiales. Cela suppose dâ€™amÃ©liorer la rÃ©gulation et la surveillance des institutions et marchÃ©s financiers, dâ€™encourager lâ€™aide au dÃ©veloppement et les investissements directs au profit des rÃ©gions oÃ¹ les besoins sont les plus grands. Faciliter une migration et une mobilitÃ© sans danger est dÃ©terminant pour rÃ©duire cette fracture grandissante.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'NjVNcxhM', 'none', 'aefhMeKu', 'fr'),
(55, ' villes et communautÃ©s durables', '11', '<p>Plus de la moitiÃ© de la population mondiale vit Ã  prÃ©sent dans les zones urbaines. Dâ€™ici 2050, cette proportion passera Ã  6,5 milliards de personnes â€“ les deux tiers de lâ€™humanitÃ©. Le dÃ©veloppement durable ne peut se faire sans transformer radicalement la faÃ§on dont nous construisons et gÃ©rons nos espaces urbains.</p><p>La croissance rapide des villes dans les pays en dÃ©veloppement, conjuguÃ©e Ã  la hausse de lâ€™exode rural, a produit un boum dans les mÃ©galopoles. En 1990, on comptait 10 mÃ©galopoles dâ€™au moins 10 millions dâ€™habitants. En 2014, leur nombre est passÃ© Ã  28, pour un total de 453 millions de personnes.</p><p>Lâ€™extrÃªme pauvretÃ© se concentre souvent dans les espaces urbains, et les dirigeants des pays et des villes peinent Ã  absorber la croissance dÃ©mographique galopante dans ces zones. Rendre les villes sÃ»res et durables implique de donner accÃ¨s Ã  des logements sÃ»rs et abordables, et de rÃ©habiliter les quartiers de taudis. Cela doit Ã©galement se traduire par des investissements dans les transports publics, par la crÃ©ation dâ€™espaces verts publics, ainsi que par une gestion et une planification de la ville amÃ©liorÃ©es, qui soient Ã  la fois participatives et inclusives.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', '8c4Hygvy', 'none', 'aefhMeKu', 'fr'),
(56, 'consommation et production responsables', '12', '<p>Parvenir Ã  une croissance Ã©conomique et Ã  un dÃ©veloppement durable exige que nous rÃ©duisions dâ€™urgence notre empreinte Ã©cologique en changeant nos modes de production et de consommation des marchandises et des ressources. Lâ€™agriculture est le plus grand consommateur dâ€™eau du monde et lâ€™irrigation engloutit dÃ©sormais prÃ¨s de 70 % de toute lâ€™eau douce propre Ã  la consommation humaine.</p><p>La gestion efficace de nos ressources naturelles partagÃ©es, ainsi que la faÃ§on dont nous Ã©liminons les dÃ©chets toxiques et les polluants, sont des cibles importantes pour cet objectif. Encourager les industries, entreprises et consommateurs Ã  recycler leurs dÃ©chets et Ã  en rÃ©duire le volume est Ã©galement important, de mÃªme que soutenir les pays en dÃ©veloppement afin quâ€™ils sâ€™orientent vers des modes de consommation plus durables dâ€™ici 2030.</p><p>Une part considÃ©rable de la population mondiale consomme toujours trop peu pour rÃ©pondre ne serait-ce quâ€™Ã  ses besoins Ã©lÃ©mentaires. RÃ©duire de moitiÃ© le volume de dÃ©chets alimentaires par habitant au niveau des distributeurs et des consommateurs est Ã©galement primordial pour crÃ©er des chaÃ®nes de production et dâ€™approvisionnement plus efficaces. Cela peut contribuer Ã  la sÃ©curitÃ© alimentaire et nous diriger vers une Ã©conomie reposant sur une utilisation plus rationnelle des ressources.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'p7fHcrir', 'none', 'aefhMeKu', 'fr'),
(57, 'mesures relatives a la lutte contre les changements climatiques', '13', '<p>Tous les pays du monde sont tÃ©moins des graves rÃ©percussions du changement climatique. Les Ã©missions de gaz Ã  effet de serre continuent Ã  augmenter et ont plus que doublÃ© depuis 1990. Qui plus est, le rÃ©chauffement mondial provoque des modifications durables de notre systÃ¨me climatique, qui font peser une menace aux consÃ©quences irrÃ©versibles si nous nâ€™agissons pas tout de suite.</p><p>Les dommages annuels moyens causÃ©s par les sÃ©ismes, tsunamis, tempÃªtes tropicales et inondations se chiffrent en centaines de milliards de dollars, avec une dÃ©pense annuelle de 6 milliards de dollars par an affectÃ©s Ã  la seule gestion des risques liÃ©s aux catastrophes. Lâ€™objectif vise Ã  mobiliser 100 milliards de dollars par an dâ€™ici 2020 pour rÃ©pondre aux besoins des pays en dÃ©veloppement et contribuer Ã  attÃ©nuer les catastrophes naturelles liÃ©es au changement climatique.</p><p>Renforcer la capacitÃ© de rÃ©sistance et dâ€™adaptation des rÃ©gions les plus vulnÃ©rables, telles que les pays sans littoral et les Ã‰tats insulaires, doit aller de pair avec des efforts pour sensibiliser et incorporer des mesures dans les politiques et stratÃ©gies nationales. Il est encore possible, avec la volontÃ© politique et un large Ã©ventail de mesures technologiques, de limiter la hausse de la tempÃ©rature mondiale moyenne Ã  deux degrÃ©s Celsius au-dessus du niveau prÃ©industriel. Cela implique une action collective urgente.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'OljJiVJN', 'none', 'aefhMeKu', 'fr'),
(58, 'vie aquatique', '14', '<p>L\'humanitÃ© dÃ©pend des ocÃ©ans de la PlanÃ¨te â€“ de leur tempÃ©rature, leur chimie, leurs courants et leur faune. La maniÃ¨re dont nous gÃ©rons cette ressource vitale est essentielle aussi pour compenser les effets du changement climatique.</p><p>Plus de trois milliards de personnes doivent leur moyen dâ€™existence Ã  la biodiversitÃ© marine et cÃ´tiÃ¨re. Cependant, on constate aujourdâ€™hui que 30 % des stocks mondiaux de poisson sont surexploitÃ©s, bien en-dessus des niveaux permettant dâ€™obtenir un rendement constant.</p><p>Les ocÃ©ans absorbent Ã©galement environ 30% du dioxyde de carbone Ã©mis par les humains, et on assiste Ã  une hausse de 26 % de lâ€™acidification des ocÃ©ans depuis le dÃ©but de la rÃ©volution industrielle. La pollution marine, rÃ©sultant essentiellement de sources terrestres, atteint des niveaux alarmants, avec une moyenne de 13 000 morceaux de dÃ©chets plastiques prÃ©sents sous chaque kilomÃ¨tre carrÃ© dâ€™ocÃ©an.</p><p>Les Objectifs de dÃ©veloppement durable offrent un cadre pour gÃ©rer durablement les Ã©cosystÃ¨mes marins et cÃ´tiers et les protÃ©ger de la pollution rÃ©sultant des activitÃ©s terrestres. Ce cadre prÃ©voit aussi de pallier les effets de lâ€™acidification des ocÃ©ans. Renforcer la prÃ©servation et lâ€™utilisation durable des ressources de lâ€™ocÃ©an au moyen de lois internationales contribuera Ã©galement Ã  attÃ©nuer une partie des dÃ©fis auxquels sont confrontÃ©s nos ocÃ©ans.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'j0Ou0Kuk', 'none', 'aefhMeKu', 'fr'),
(59, 'vie terrestre', '15', '<p>La vie humaine dÃ©pend autant de la Terre que des ocÃ©ans pour assurer notre existence et notre subsistance. Les vÃ©gÃ©taux fournissent 80 % de notre alimentation, et nous dÃ©pendons de lâ€™agriculture en tant que ressource Ã©conomique et moyen de dÃ©veloppement. La forÃªt, qui couvre 30 % de la surface de la Terre, fournit un habitat vital pour des millions dâ€™espÃ¨ces, une source saine et importante dâ€™air et dâ€™eau, et elle est Ã©galement cruciale dans la lutte contre le changement climatique.</p><p>Nous assistons aujourdâ€™hui Ã  une dÃ©gradation des terres sans prÃ©cÃ©dent, et le taux de disparition des terres arables est 30 Ã  35 fois supÃ©rieur que par le passÃ©. La sÃ©cheresse et la dÃ©sertification gagnent du terrain chaque annÃ©e, contribuant Ã  la disparition de 12 millions dâ€™hectares et affectant les communautÃ©s pauvres aux quatre coins de la PlanÃ¨te. Sur 8 300 espÃ¨ces dâ€™animaux dâ€™Ã©levage connues, 8 % sont disparues et 22 % sont en voie dâ€™extinction.</p><p>Les Objectifs de dÃ©veloppement durable visent Ã  protÃ©ger et Ã  restaurer lâ€™usage des Ã©cosystÃ¨mes terrestres tels que les forÃªts, les zones humides, les milieux arides et les montagnes dâ€™ici 2020. Il est aussi vital de promouvoir la gestion durable des forÃªts et de mettre un terme aux dÃ©forestations afin dâ€™attÃ©nuer lâ€™impact du changement climatique. Une action urgente doit Ãªtre menÃ©e afin de rÃ©duire le dÃ©clin des habitats naturels et de la diversitÃ© qui font partie de notre hÃ©ritage commun.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'xOudHrFF', 'none', 'aefhMeKu', 'fr'),
(60, ' paix, justice et institutions efficaces', '16', '<p>La paix, la stabilitÃ©, les droits humains et une gouvernance efficace fondÃ©e sur lâ€™Ã©tat de droit sont des vecteurs importants pour le dÃ©veloppement durable. Nous vivons dans un monde de plus en plus divisÃ©. Certaines rÃ©gions profitent durablement de la paix, de la sÃ©curitÃ© et de la prospÃ©ritÃ©, alors que dâ€™autres sont entraÃ®nÃ©es dans un cycle de conflits et de violence qui semble sans fin. Ceci nâ€™est en aucun cas inÃ©vitable.</p><p>Des niveaux Ã©levÃ©s de violence armÃ©e et dâ€™insÃ©curitÃ© ont un effet destructeur sur le dÃ©veloppement dâ€™un pays, en entravant la croissance Ã©conomique et en engendrant souvent des souffrances durables au sein de la population, qui peuvent persister pendant des gÃ©nÃ©rations. Les violences sexuelles, la criminalitÃ©, lâ€™exploitation et la torture sont Ã©galement omniprÃ©sents sur les lieux de conflits ou sans Ã©tat de droit. Les nations doivent prendre des mesures pour protÃ©ger ceux qui sont le plus Ã  risque.</p><p>Les Objectifs de dÃ©veloppement durable visent Ã  rÃ©duire largement toutes les formes de violence, et Ã  Å“uvrer aux cÃ´tÃ©s des gouvernements et des communautÃ©s afin de trouver des solutions durables aux conflits et Ã  lâ€™insÃ©curitÃ©. Le renforcement de lâ€™Ã©tat de droit et la promotion des droits humains sont au cÅ“ur de ce processus, tout comme la rÃ©duction du trafic illÃ©gal dâ€™armes et le renforcement de la participation des pays en dÃ©veloppement aux institutions de gouvernance mondiale.</p><p><br></p><p><span style=\"font-size:12px;\">Source: UNDP</span></p>', 'nvyM8x4O', 'none', 'aefhMeKu', 'fr'),
(61, ' partenariat pour la rÃ©alisation des objectifs', '17', '<p>Seul un engagement fort, liÃ© Ã  des partenariats et une coopÃ©ration au niveau mondial, peut permettre de rÃ©aliser les Objectifs de dÃ©veloppement durable. Alors que lâ€™aide publique au dÃ©veloppement de la part des pays dÃ©veloppÃ©s a augmentÃ© de 66 % entre 2000 et 2014, les crises humanitaires causÃ©es par les conflits ou les catastrophes naturelles continuent Ã  requÃ©rir des ressources financiÃ¨res et de lâ€™aide humanitaire. De nombreux pays ont Ã©galement besoin de lâ€™aide publique au dÃ©veloppement pour soutenir leur croissance et leur commerce.</p><p>Le monde actuel est plus interconnectÃ© que jamais auparavant. Lâ€™amÃ©lioration de lâ€™accÃ¨s aux technologies et Ã  la connaissance favorise nettement le partage des idÃ©es et lâ€™innovation. La coordination des politiques dâ€™aide Ã  la gestion des dettes des pays en dÃ©veloppement, ainsi que la promotion des investissements dans les pays les moins dÃ©veloppÃ©s, sont essentielles afin de parvenir Ã  une croissance et Ã  un dÃ©veloppement durables.</p><p>Les objectifs visent Ã  amÃ©liorer les coopÃ©rations Nord-Sud et Sud-Sud, par lâ€™appui aux plans nationaux destinÃ©s Ã  atteindre toutes les cibles. Promouvoir le commerce international et aider les pays en dÃ©veloppement Ã  accroÃ®tre leurs exportations, font partie intÃ©grante de la rÃ©alisation dâ€™un systÃ¨me de commerce universel, basÃ© sur des rÃ¨gles, Ã©quitable, qui soit juste et ouvert, et qui bÃ©nÃ©ficie Ã  tous.</p><p><br></p><p><span style=\"font-size:12px;\">Sources: UDNP</span></p>', 'SySObih7', 'none', 'aefhMeKu', 'fr'),
(62, 'Motivation', 'none', 'Q: C\'est quoi les objectifs de dÃ©veloppement durable (ODD)?<br><br>R: Les 17 ODD sont des objectifs universels qui ont Ã©tÃ© adoptÃ©s par tous les Ã‰tats membres des Nations Unies en 2015 pour guider la collaboration internationale vers le dÃ©veloppement durable.&nbsp; Ils succÃ¨dent aux objectifs du MillÃ©naire pour le dÃ©veloppement et visent Ã  mettre fin Ã  la pauvretÃ©, Ã  lutter contre les inÃ©galitÃ©s, Ã  protÃ©ger la planÃ¨te, Ã  promouvoir la paix et Ã  assurer la prospÃ©ritÃ© pour tous.&nbsp; Chaque objectif a des cibles spÃ©cifiques Ã  atteindre avant 2030. Veuillez visiter le site web des Nations Unies pour plus d\'informations sur les ODD.<br><br>Q: Pourquoi l\'Indice et les Tableaux de Bord pour l\'Afrique?<br><br>R: Plus que toute autre rÃ©gion du monde, l\'Afrique est confrontÃ©e Ã  d\'importants dÃ©fis en ce qui concerne la rÃ©alisation des ODD. L\'Indice et&nbsp; les Tableaux de Bord des ODD pour l\'Afrique pour l\'annÃ©e 2018 prÃ©sente une analyse de la situation actuelle des pays africains en matiÃ¨re de rÃ©alisation des ODD. L\'Indice des ODD pour l\'Afrique rassemble les donnÃ©es disponibles sur tous les ODD en un indice composite pour donner aux pays africains une Ã©valuation rapide de leur performance par rapport Ã  leurs pairs. En tant qu\'outil d\'analyse comparative, l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique peuvent appuyer les discussions nationales sur l\'opÃ©rationnalisation des ODD et guider les politiques nationales et les stratÃ©gies Ã  long terme pour le dÃ©veloppement durable. <br>Dans l\'ensemble, selon ces tableaux de bord, les objectifs qui prÃ©sentent le plus de dÃ©fis sont la santÃ© (ODD 3), les infrastructures (ODD 9) et la paix, la justice et les institutions efficaces (ODD 16) avec plus de 80% des pays marquÃ©s en rouge. La sÃ©curitÃ© alimentaire et lâ€™agriculture durable (ODD 2), lâ€™accÃ¨s Ã  lâ€™Ã©nergie (ODD 7) et les Ã©cosystÃ¨mes marins (ODD 14) sont Ã©galement des dÃ©fis majeurs qui doivent Ãªtre considÃ©rÃ©s comme prioritaires dans environ 70% des pays. Pour 14 des 17 objectifs, aucun pays africain nâ€™a pu marquer un vert, selon le systÃ¨me de codage en couleur du tableau de bord. Pour les trois objectifs restants, il n\'y a qu\'une poignÃ©e de pays marquÃ©s en vert â€“ les mesures relatives Ã  la lutte contre les changements climatiques (ODD 13) compte cinq verts, et les Ã©cosystÃ¨mes terrestres (ODD 15) et la consommation et la production durables (ODD 12) comptant trois verts respectivement.<br><br>Q: L\'Indice et les Tableaux de Bord des ODD pour l\'Afrique remplacent-ils ou font-ils concurrence au suivi officiel des ODD?<br>R: Non. L\'Indice et les Tableaux de Bord des ODD pour l\'Afrique sont des outils analytiques prÃ©liminaires destinÃ©s Ã  aider les gouvernements et les autres parties prenantes Ã  faire le point sur leurs objectifs actuels en matiÃ¨re de rÃ©alisation des ODD et Ã  identifier les prioritÃ©s d\'action. Au fur et Ã  mesure que de nouvelles donnÃ©es deviendront disponibles, elles figureront sur l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique, qui seront publiÃ©s chaque annÃ©e. SimultanÃ©ment, les pays devront dÃ©velopper une sÃ©rie complÃ¨te de systÃ¨mes de suivi pour les indicateurs des ODD recommandÃ©s par la Commission de Statistique des Nations Unies. Cela nÃ©cessitera des investissements importants dans le dÃ©veloppement des capacitÃ©s statistiques, en particulier dans les pays les plus pauvres ou ceux ayant une faible capacitÃ© statistique. Au fil du temps, chaque pays devrait Ãªtre en mesure de suivre les variables essentielles des ODD pour faire le suivi des progrÃ¨s accomplis dans la rÃ©alisation des objectifs.<br>', 'VpOSrr8r', 'none', 'd4hVSHOj', 'fr'),
(63, 'Couverture par pays et sÃ©lection des indicateurs', 'none', 'Q: Comment les indicateurs ont-ils Ã©tÃ© sÃ©lectionnÃ©s pour l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique?&nbsp; Pourquoi ne sont-ils pas identiques aux indicateurs officiels des ODD proposÃ©s?<br><br>R: Au dÃ©but de 2016, la Commission de Statistique des Nations Unies a recommandÃ© plusieurs indicateurs pour mesurer les progrÃ¨s accomplis dans la rÃ©alisation des ODD. En avril 2017, la Commission de Statistique des Nations Unies avait approuvÃ© 232 indicateurs. Cependant, pour la plupart des pays, les donnÃ©es restent indisponibles pour la grande majoritÃ© de ces indicateurs proposÃ©s. Il faudra du temps et des investissements en matiÃ¨re de capacitÃ© statistique pour mettre en place des systÃ¨mes de donnÃ©es nationaux afin que chaque pays puisse suivre les progrÃ¨s accomplis par rapport aux indicateurs officiels. ParallÃ¨lement, les pays doivent entamer le processus dâ€™opÃ©rationnalisation et de mise en Å“uvre des ODD en utilisant les donnÃ©es disponibles actuellement.<br>L\'Indice des ODD pour l\'Afrique a Ã©tÃ© construit sur un ensemble d\'indicateurs pour chacun des 17 ODD en utilisant les donnÃ©es publiÃ©es les plus rÃ©centes. Nous avons examinÃ© chacun des 232 indicateurs d\'ODD proposÃ©s par le Groupe Interinstitutions et d\'Experts sur les indicateurs des ODD et approuvÃ©s par la Commission de Statistique des Nations Unies et avons inclus ceux rÃ©pondant Ã  cinq critÃ¨res. Certains indicateurs officiels des ODD rÃ©pondaient aux cinq critÃ¨res mais ne pouvaient Ãªtre inclus car ils ne permettaient pas de classer les pays ou de dÃ©finir un seuil quantitatif indiquant la rÃ©alisation des objectifs applicables Ã  tous les pays. Par exemple, diffÃ©rents pays se spÃ©cialisent dans diffÃ©rents secteurs de lâ€™Ã©conomie, de sorte quâ€™il nâ€™y a pas de seuil de production Â«appropriÃ©Â» en tant que part du PIB que tous les pays devraient viser.&nbsp; <br>Lorsque les indicateurs officiels des ODD ne rÃ©pondaient pas aux critÃ¨res de sÃ©lection des donnÃ©es ou que des Ã©carts d\'indicateurs persistaient, nous considÃ©rions des indicateurs officiels et les autres publiÃ©s dans des documents Ã©valuÃ©s par des pairs, ainsi que les principales bases de donnÃ©es et les rapports sur les indicateurs de dÃ©veloppement et environnementaux. En raison de la disponibilitÃ© limitÃ©e des donnÃ©es et de l\'absence de paramÃ¨tres de mesure pour les principales prioritÃ©s en matiÃ¨re des ODD, en particulier l\'Ã©ducation et les inÃ©galitÃ©s, ce rapport est encore incomplet.&nbsp; Au fur et Ã  mesure que la disponibilitÃ© des donnÃ©es s\'amÃ©liore et que de nouvelles techniques d\'estimation deviennent disponibles, les Ã©ditions ultÃ©rieures de l\'Indice et des Tableaux de Bord des ODD pour l\'Afrique pourront inclure des variables supplÃ©mentaires. <br>Pour cette premiÃ¨re Ã©dition, nous avons inclus 97 indicateurs provenant d\'une vaste gamme de sources de donnÃ©es, dont 28 sont spÃ©cifiques Ã  l\'Afrique, y compris des indicateurs du plan de mise en Å“uvre dÃ©cennal de l\'A2063. Les indicateurs rÃ©visÃ© comprennent des nouveaux indicateurs et nouvelles rÃ©visions pour combler les lacunes et pour mieux aligner l\'Indice et les Tableaux de Bord des ODD&nbsp; aux besoins de suivi des Ã‰tats africains.&nbsp; L\'Indice des ODD pour l\'Afrique couvre 51 des 54 Ã‰tats membres africains de l\'ONU.<br><br>Q: Pourquoi certains pays ne figurent pas sur l\'Indice des ODD pour l\'Afrique?<br>R: Un pays figure sur l\'Indice des ODD pour l\'Afrique s\'il dispose de donnÃ©es pour au moins 80% des indicateurs. Certains pays de moins d\'un million d\'habitants disposent de donnÃ©es suffisantes et figurent donc sur l\'Indice des ODD pour l\'Afrique, malgrÃ© les critÃ¨res de sÃ©lection des indicateurs de 80% de disponibilitÃ© des donnÃ©es dans les pays de plus d\'un million d\'habitants. Le fait que certains pays ne disposent pas de donnÃ©es suffisantes pour figurer sur l\'Indice des ODD pour l\'Afrique souligne la nÃ©cessitÃ© d\'investir davantage dans le renforcement des capacitÃ©s statistiques.<br><br>Q.: D\'oÃ¹ proviennent les donnÃ©es de&nbsp; l\'Indice et des Tableaux de Bord des ODD pour l\'Afrique?<br>R: Dans la mesure du possible, les donnÃ©es de l\'Indice et des Tableaux de Bord des ODD pour l\'Afrique reposent sur des statistiques officielles comparables au niveau international. Afin de combler certaines lacunes dans les donnÃ©es officielles, des parametres de mesure non officielles provenant d\'autres sources rÃ©putÃ©es ont Ã©tÃ© utilisÃ©es, comme dÃ©crit dans les mÃ©tadonnÃ©es en ligne. Pour chaque indicateur, les donnÃ©es ont Ã©tÃ© rigoureusement sÃ©lectionnÃ©es et examinÃ©es en termes de qualitÃ©, de dÃ©lais et de vÃ©rifiabilitÃ©.<br>', 'O8Oux3Fy', 'none', 'd4hVSHOj', 'fr');
INSERT INTO `mvc_article` (`id`, `title`, `subtitle`, `content`, `article_index`, `logo`, `section_index`, `lang`) VALUES
(64, 'MÃ©thodologie', 'none', 'Q: Comment est-ce que l\'Indice et les Tableaux de Bord comparent-ils la performance entre diffÃ©rents indicateurs?<br>R: Afin de garantir la comparabilitÃ©, nous normalisons les donnÃ©es pour chaque indicateur en le transformant linÃ©airement en une Ã©chelle de 0 Ã  100. Une valeur de 100 indique une performance optimale technique, tandis qu\'une valeur de zÃ©ro indique le 2,5Ã¨me centile dans la rÃ©partition. Pour plus de clartÃ© et de facilitÃ© d\'interprÃ©tation, nous transformons certains indicateurs afin que, dans chaque cas, un score plus Ã©levÃ© sur l\'indicateur normalisÃ© corresponde Ã  un progrÃ¨s global plus Ã©levÃ©.<br><br>Q: Comment est-ce les ODD et les indicateurs sont-ils pondÃ©rÃ©s?<br>R: Chaque ODD a le mÃªme poids sur lâ€™Indice et les Tableaux de Bord, ce qui est conforme Ã  lâ€™esprit des ODD. Cela implique que les pays doivent poursuivre tous les 17 objectifs Ã  travers les stratÃ©gies intÃ©grÃ©es. Au sein de chaque objectif, chaque indicateur est mesurÃ© de maniÃ¨re Ã©gale, ce qui implique que chaque indicateur est mesurÃ© Ã  l\'inverse du nombre d\'indicateurs disponibles pour cet ODD particulier. Un avantage de cette approche est que, Ã  mesure que des donnÃ©es de plus en plus nombreuses deviennent disponibles, de nouvelles variables peuvent facilement Ãªtre ajoutÃ©es aux diffÃ©rents ODD sans toutes fois modifier la pondÃ©ration relative des objectifs. De cette maniÃ¨re, l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique peuvent Ã©voluer au fil du temps que chaque communautÃ© Ã©pistÃ©mique donne de nouvelles donnÃ©es de meilleure qualitÃ©.<br><br>Q: Comment interprÃ©ter les Tableaux de Bord des ODD pour l\'Afrique?<br>R: Il y a d\'autres indices qui utilisent la performance relative Ã  travers les pays pour dÃ©finir les seuils. Nous pensons que les seuils absolus sont plus appropriÃ©s puisque la plupart des ODD nÃ©cessitent la rÃ©alisation des seuils absolus. Pour Ã©valuer les progrÃ¨s d\'un pays sur un indicateur particulier, de tels seuils quantitatifs absolus sont introduits pour diffÃ©rencier les situations oÃ¹ le seuil des ODD a Ã©tÃ© atteint (vert), oÃ¹ des problÃ¨mes importants demeurent (jaune et orange) et oÃ¹ un pays doit trouver des solutions aux problÃ¨mes importants s\'il se veut atteindre l\'objectif (rouge). Dans la mesure du possible, ces seuils sont dÃ©rivÃ©s des ODD, de leurs cibles ou d\'autres sources officielles. Tous les seuils sont spÃ©cifiÃ©s dans les mÃ©tadonnÃ©es en ligne.<br><br>Q: Comment sont calculÃ©s les scores de l\'Indice et des Tableaux de Bord des ODD pour l\'Afrique et quelle mÃ©thode dâ€™agrÃ©gation est utilisÃ©e?<br>R: Le choix de la formule d\'agrÃ©gation peut avoir des implications importantes pour les rÃ©sultats de l\'Indice et des Tableaux de Bord des ODD pour l\'Afrique. La considÃ©ration d\'une simple moyenne de valeurs d\'indicateur (agrÃ©gation arithmÃ©tique) implique que les indicateurs sont parfaitement substituables: le progrÃ¨s sur une variable peut compenser le manque de progrÃ¨s sur un autre. Cette approche est raisonnable pour les indicateurs au sein du mÃªme objectif, qui tendent Ã  se complÃ©ter. Nous utilisons donc des mÃ©thodes arithmÃ©tiques pour rassembler les indicateurs de chaque ODD pour l\'Indice&nbsp; et les Tableaux de Bord.<br>Cependant, des compromis majeurs peuvent survenir entre les ODD. Les progrÃ¨s accomplis dans la rÃ©alisation dâ€™un objectif (par exemple, une croissance Ã©conomique plus forte) ne peuvent pas totalement compenser lâ€™absence de progrÃ¨s dans un autre (par exemple, lâ€™inÃ©galitÃ© croissante ou la dÃ©gradation de lâ€™environnement). Pour cette raison, les pays doivent progresser vers tous les objectifs.&nbsp; En d\'autres termes, on doit supposer une substituabilitÃ© limitÃ©e entre les objectifs, ce qui se fait gÃ©nÃ©ralement en utilisant la moyenne gÃ©omÃ©trique.&nbsp; En consÃ©quence, on pourrait argumenter sur l\'utilisation de la moyenne gÃ©omÃ©trique des scores pour chaque ODD afin de calculer l\'indice global des ODD pour l\'Afrique.<br>NÃ©anmoins, les deux mÃ©thodes d\'agrÃ©gation donnent presque les mÃªmes classements et presque les mÃªmes scores pour la plupart des pays.&nbsp; Pour simplifier, nous utilisons donc l\'agrÃ©gation arithmÃ©tique mÃªme si l\'agrÃ©gation gÃ©omÃ©trique est conceptuellement attrayante. Cela laisse une interprÃ©tation naturelle de la signification du score national de l\'indice des ODD pour l\'Afrique. Une valeur de lâ€™Indice des ODD pour lâ€™Afrique (par exemple 66) signifie donc que le pays reprÃ©sente un certain pourcentage (par exemple 66%) du pire score au meilleur en moyenne pour les 17 ODD.<br>Une troisiÃ¨me mÃ©thode pour agrÃ©ger les scores des indicateurs est la fonction minimale de Leontief, qui attribue la valeur de l\'indicateur sur lequel le pays est le moins performant comme score pour l\'ODD. Cette agrÃ©gation est utile pour identifier les domaines dans lesquels chaque pays doit rÃ©aliser les plus grands progrÃ¨s, mais apparait comme une approche trop Â«rigoureuseÂ» pour permettre la comparaison des pays.<br>Pour les tableaux de bord des ODD pour l\'Afrique, nous utilisons la moyenne des deux indicateurs les moins performants pour attribuer des couleurs aux ODD. Pour quâ€™il y ait un score en Â«rougeÂ», les deux&nbsp;&nbsp;&nbsp;&nbsp; indicateurs les moins performants doivent Ãªtre en Â«rougeÂ». Pour atteindre le Â«vertÂ», tous les indicateurs sous l\'objectif doivent Ãªtre en Â«vertÂ». Si la note moyenne se situe sur la Â«ligne dâ€™alerteÂ» (, l\'ODD se voit attribuer le Â«jauneÂ» ou Â«orangeÂ», en fonction des progrÃ¨s rÃ©alisÃ©s par le pays dans le passage du Â«rougeÂ» au Â«vertÂ».<br><br>Q: Comment l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique se prennent-ils quant aux donnÃ©es manquantes?<br><br>R: L\'Indice et les Tableaux de Bord des ODD pour l\'Afrique ne modÃ©lisent ni nâ€™extrapolent les donnÃ©es au niveau des indicateurs pour combler les lacunes, car les extrapolations sont sujettes aux erreurs. Toutefois, afin de calculer les rÃ©sultats totaux de lâ€™indice des pays, nous attribuons des notes moyennes rÃ©gionales aux pays qui ne disposent pas de donnÃ©es sur un objectif. Cela s\'applique principalement Ã  l\'objectif 10 (InÃ©galitÃ©s RÃ©duites) et Ã  l\'objectif 14 (Vie Aquatique). NÃ©anmoins, ils sont prÃ©sentÃ©s comme des donnÃ©es manquantes dans les profils des pays. Ã€ ce stade de la mise en Å“uvre des ODD, nous souhaitons Ã©galement mettre en Ã©vidence les lacunes dans les donnÃ©es afin dâ€™encourager les gouvernements et le systÃ¨me international Ã  les combler. Il existe quelques exceptions oÃ¹ les donnÃ©es ont Ã©tÃ© attribuÃ©es Ã  des groupes entiers de pays (sous-rÃ©gions).<br><br>Q: Comment estimez-vous les tendances?<br><br>En utilisant des donnÃ©es historiques, nous estimons Ã  quelle vitesse un pays a progressÃ© pour lâ€™achÃ¨vement dâ€™ODD et dÃ©terminons si cela se poursuit Ã  l\'avenir - ce rythme sera suffisant pour atteindre l\'ODD d\'ici 2030. Pour chaque indicateur, la rÃ©alisation d\'ODD est dÃ©finie par le seuil vert fixÃ© pour les tableaux de bord des ODD pour l\'Afrique. La diffÃ©rence en points de pourcentage entre le seuil vert et le score normalisÃ© de pays&nbsp; indique l\'Ã©cart Ã  combler pour atteindre cet objectif. Pour estimer les tendances des ODD, nous avons calculÃ© les taux de croissance annuels linÃ©aires (c.-Ã -d. les amÃ©liorations annuelles en pourcentage) nÃ©cessaires pour atteindre l\'objectif d\'ici 2030 (2010-2030) que nous avons comparÃ©s au taux de croissance annuel moyen de la pÃ©riode la plus rÃ©cente (gÃ©nÃ©ralement 2010-2015). Les progrÃ¨s vers la rÃ©alisation d\'objectifs sur un indicateur particulier sont dÃ©crits Ã  l\'aide d\'un systÃ¨me de 5 flÃ¨ches.<br><br>Pour estimer les tendances gÃ©nÃ©rales d\'un ODD, chaque tendance de l\'indicateur pour cet ODD a Ã©tÃ© normalisÃ©e sur une Ã©chelle linÃ©aire de 0 Ã  4. La tendance pour un ODD a Ã©tÃ© calculÃ©e comme la moyenne arithmÃ©tique de tous les indicateurs de cette tendance pour cet objectif. Une moyenne entre 0 et 1 correspond Ã  une tendance Â«dÃ©croissanteÂ» d\'un objectif, celle de 1-2, une tendance Â«stagnanteÂ», celle de 2-3, une Â«tendance modÃ©rÃ©ment encourageanteÂ» et celle de 3-4, une tendance Â«en bonne voieÂ». Maintien de la rÃ©alisation d\'ODD correspond Ã  un score normalisÃ© de 3 exactement. Les tendances sont rapportÃ©es au niveau d\'un ODD uniquement si des donnÃ©es sur les tendances Ã©taient disponibles pour au moins 75% des indicateurs de tableaux de bord des ODD pour l\'Afrique sur cet objectif. Les tendances d\'ODD&nbsp; sont basÃ©es sur des points de donnÃ©es qui prÃ©cÃ¨dent l\'adoption des ODD, car les donnÃ©es sont signalÃ©es avec de longs dÃ©calages au niveau international en raison de longs processus de validation. Au fil du temps, nous mettrons Ã  jour les donnÃ©es pour utiliser 2015 comme annÃ©e de rÃ©fÃ©rence pour les tendances d\'ODD.<br><br>Les indicateurs de tendances ont Ã©tÃ© sÃ©lectionnÃ©s parmi les indicateurs inclus dans les tableaux de bord des ODD pour lâ€™Afrique en fonction de la disponibilitÃ© des donnÃ©es de tendances. Lorsque la valeur pour un an n\'Ã©tait pas disponible, nous utilisions la valeur disponible la plus proche avec une diffÃ©rence maximale d\'un an.<br><br>Plusieurs autres mÃ©thodes de calcul ont Ã©tÃ© envisagÃ©es Ã©galement. Par exemple, nous avons testÃ© la sensibilitÃ© des rÃ©sultats lors de lâ€™utilisation de performances optimales techniques (score de 100) en tant que Â«rÃ©alisation d\'objectifsÂ» et nous avons calculÃ© la distance aux performances optimales techniques. Cette approche a donnÃ© des rÃ©sultats plus rigoureux et ne correspond pas Ã  notre hypothÃ¨se conceptuelle selon laquelle des seuils verts plus bas correspondent Ã  la rÃ©alisation des objectifs.&nbsp; Nous avons Ã©galement envisagÃ© d\'utiliser des taux de croissance annuels composÃ©s (TCAC) plutÃ´t que des taux de croissance linÃ©aires. Les deux approches donnent des rÃ©sultats assez similaires et nous n\'avons pas pu identifier un argument solide en faveur de l\'utilisation de la mÃ©thode TCAC plus sophistiquÃ©e. Enfin, alors que les tableaux de bord reposent uniquement sur les deux pires indicateurs, les tendances sont gÃ©nÃ©rÃ©es en utilisant tous les indicateurs sous cet objectif. En effet, les tableaux de bord visent Ã  mettre en Ã©vidence les objectifs nÃ©cessitant une attention particuliÃ¨re en raison de trÃ¨s faibles performances sur certains des indicateurs sous-jacents, alors que les tendances visent Ã  reflÃ©ter l\'Ã©volution globale des objectifs, y compris tous les indicateurs.<br><br>Q: Comment l\'analyse de tendance traite-t-elle les pays qui ont dÃ©jÃ  atteint une cible d\'ODD?<br><br>R: Notre mÃ©thodologie ignore les mouvements (positifs et nÃ©gatifs) qui dÃ©passent la rÃ©alisation des objectifs (le seuil vert). Conceptuellement, notre objectif est de montrer combien les pays progressent vers la rÃ©alisation des objectifs. Par consÃ©quent, un pays au-dessus du seuil vert et qui a maintenu ses performances au-dessus du seuil vert est automatiquement considÃ©rÃ© comme ayant maintenu une performance supÃ©rieure Ã  la rÃ©alisation des objectifs.&nbsp; Au niveau des objectifs, cette flÃ¨che nâ€™est donnÃ©e que lorsque tous les indicateurs de tendance dâ€™un pays ont maintenu des performances supÃ©rieures Ã  leurs seuils verts respectifs.<br><br>', '4wMlbOVK', 'none', 'd4hVSHOj', 'fr'),
(65, 'InterprÃ©tation des rÃ©sultats et des limites', 'none', 'Q: Le Maroc est classÃ© numÃ©ro 1 sur l\'Indice des ODD pour l\'Afrique.&nbsp; Est-ce que cela signifie que le pays a atteint tous les ODD?<br><br>R: Absolument pas. Alors que le Maroc se comporte mieux en moyenne sur la base des donnÃ©es que nous avons pu recueillir pour lâ€™Indice des ODD pour l\'Afrique, Les Tableaux de Bords des ODD pour l\'Afrique montrent clairement que chaque pays est confrontÃ© Ã  des dÃ©fis majeurs dans la rÃ©alisation des ODD. C\'est le cas Ã©galement du Maroc et des autres pays en tÃªte du classement.<br><br>Q: Quel est le lien entre lâ€™Indice des ODD pour l\'Afrique et les autres indices de dÃ©veloppement pour les ODD?<br><br>R: Il existe de nombreux autres indices composites de dÃ©veloppement, mais nous ne sommes pas au courant d\'un seul qui fait le suivi des 17 ODD au niveau national. En 2015, la Bertelsmann Stiftung a publiÃ© un rapport qui a Ã©tÃ© le premier Ã  dÃ©velopper un indice pour les pays de l\'OCDE afin de suivre la rÃ©alisation des ODD et de dÃ©terminer les prioritÃ©s de mise en Å“uvre dans chaque pays. Un autre effort important a Ã©tÃ© entrepris par lâ€™Overseas Development Institute, qui prÃ©sente un tableau de bord rÃ©gional des ODD, projetant les tendances Ã  travers les dimensions clÃ©s des ODD afin de dÃ©terminer les domaines qui nÃ©cessiteront une accÃ©lÃ©ration plus rapide des progrÃ¨s. L\'Indice et les Tableaux de Bord des ODD pour l\'Afrique, cependant, fournissent un index global complet pour suivre la mise en Å“uvre des ODD.<br><br>Q: Comment puis-je accÃ©der aux donnÃ©es de mon pays ou de ma rÃ©gion?<br><br>R: Les profils et les donnÃ©es des pays&nbsp; sont disponibles pour le tÃ©lÃ©chargement sur ce site. Les donnÃ©es sont mises Ã  jour chaque annÃ©e.<br><br>Q: Quelles sont les principales limitations de donnÃ©es?<br><br>R: Pour s\'assurer d\'une comparabilitÃ© maximale des donnÃ©es, nous utilisons uniquement des donnÃ©es provenant de sources comparables au niveau international. Le rapport s\'appuie sur des donnÃ©es validÃ©es et publiÃ©es par des organisations internationales et d\'autres fournisseurs susceptibles d\'ajuster les donnÃ©es nationales pour assurer la comparabilitÃ© internationale. En consÃ©quence, certains points de donnÃ©es prÃ©sentÃ©s dans ce rapport peuvent diffÃ©rer des donnÃ©es disponibles auprÃ¨s des agences nationales de statistiques. En outre, la longueur des processus de validation chez les organisations internationales peut entraÃ®ner des retards importants dans la publication des donnÃ©es plus actualisÃ©es. Par consÃ©quent, les agences nationales de statistique peuvent disposer de donnÃ©es plus rÃ©centes pour certains indicateurs. En outre, il est important de noter que les rÃ©sultats de chaque annÃ©e ne reflÃ¨tent pas complÃ¨tement lâ€™annÃ©e de publication, car ils sont basÃ©s sur les donnÃ©es les plus disponibles. <br>De plus, les limitations qui sâ€™appliquent traditionnellement Ã  tout indice composite sâ€™appliquent Ã©galement ici.&nbsp; Ce n\'est pas un outil parfait; mais, cependant, il sâ€™agit dâ€™un outil visant Ã  fournir un aperÃ§u de la maniÃ¨re dont lâ€™Afrique progresse dans les ODD dans un espace oÃ¹ un tel outil nâ€™existe pas actuellement.<br>Enfin, les tendances d\'ODD rapportÃ©es sont basÃ©es sur des points de donnÃ©es qui prÃ©cÃ¨dent l\'adoption des ODD, mais les donnÃ©es sont rapportÃ©es avec de longs dÃ©calages au niveau international en raison de longs processus de validation. Au fil du temps, nous mettrons Ã  jour les donnÃ©es pour utiliser 2015 comme annÃ©e de rÃ©fÃ©rence pour les tendances d\'ODD. Dans les prochaines Ã©ditions, nous viserons Ã  inclure des indicateurs des ODD supplÃ©mentaires et amÃ©liorÃ©s tout en visant une meilleure comparabilitÃ© dans le temps.<br><br>Q: Quand est-ce que l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique seront-ils mis Ã  jour?<br><br>R: L\'Indice et les Tableaux de Bord des ODD pour l\'Afrique seront mis Ã  jour chaque annÃ©e pour inclure de nouveaux indicateurs dÃ¨s quâ€™ils seront disponibles, pour mettre Ã  jour les donnÃ©es et incorporer des suggestions sur la maniÃ¨re de rendre les outils plus utiles pour les pays et les autres parties prenantes. Le site web sera continuellement amÃ©liorÃ© pour faciliter lâ€™utilisation des donnÃ©es et des comparaisons entre les pays.<br>', 'MffJO8rN', 'none', 'd4hVSHOj', 'fr'),
(66, 'Contacts', 'none', 'Q: Ã€ qui puis-je adresser mes commentaires sur l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique?<br><br>R: Nous vous invitons Ã  nous faire part de vos commentaires et suggestions pour amÃ©liorer l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique. Veuillez adresser vos commentaires et suggestions Ã  africasdgindex@sdgcafrica.org ou Ã  africa@sdgindex.org.<br><br>Notation<br>&nbsp;<br>ODD rÃ©alisÃ©<br>&nbsp;<br>Des dÃ©fis persistent<br>&nbsp;<br>Des dÃ©fis importants persistent<br>&nbsp;<br>Des dÃ©fis majeurs persistent<br>&nbsp;<br>[Information non disponible]<br><br>Tendance<br>Maintien de la rÃ©alisation d\'ODD<br>En bonne voie pour atteindre l\'objectif d\'ici 2030<br>Score modÃ©rÃ©ment croissant, insuffisant pour atteindre l\'objectif<br>Score stagnant ou augmentant Ã  moins de 50% du taux requis<br>Score dÃ©croissant<br>Informations sur la tendance non disponibles<br><br>', 'i8OOca0f', 'none', 'd4hVSHOj', 'fr');
