(16, 'L\'Indice et les Tableaux de Bord des ODD pour l\'Afrique pour lâ€™annÃ©e 2018 - version compacte', '2018 Africa SDG Index Report - Compact.pdf', 'La version compacte du rapport de 2018 sur l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique est une version simplifiÃ©e du rapport complet qui ne contient que le texte.&nbsp; Tous les profils des pays ont Ã©tÃ© exclus.<br>', 2018, 'klau3t7dgbweh', 'Reports', 'fr'),
(17, 'Rapport abrÃ©gÃ© de 2018 sur l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique', 'AFRICA-SDG-2018-Final-Summary-Report.pdf', 'RÃ©sumÃ© exÃ©cutif du rapport de 2018 sur l\'Indice et les Tableaux de Bord des ODD pour l\'Afrique.<br>', 2018, 'dcnbjdnasfdjk', 'Reports', 'fr'),
(23, '2018 Africa SDG Index and Dashboards Report', 'AFRICA SDGS 2018 Report WEB V6 220818 (1).pdf', '<p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(243, 243, 243);\">The 2018 Africa SDG Index and Dashboards Report is the first report of its kind examining Africaâ€™s SDG performance. It was created to help African countries and leaders identify priorities for action, understand the key implementation challenges and identify the gaps that must be closed in order to achieve the SDGs by 2030.</span></p>', 2018, 'VihHp083', 'Reports', 'en'),
(24, '2018 Africa SDG Index and Dashboards - Compact edition', '2018 Africa SDG Index Report - Compact.pdf', '<p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(243, 243, 243);\">The compact edition of the 2018 Africa SDG Index and Dashboards is a reduced version of the full report featuring only the text. All the country profiles have been excluded.</span></p>', 2018, 'j8GkOOjE', 'Reports', 'en'),
(25, '2018 Africa SDG Index and Dashboards Summary Report', 'AFRICA-SDG-2018-Final-Summary-Report.pdf', '<span style=\"color: rgb(33, 37, 41); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(243, 243, 243);\">Executive summary of the 2018 Africa SDG Index and Dashboards Report.</span>', 2018, 'xGOkvlMF', 'Reports', 'en'),
(26, 'Africa SDG Index 2018 Data', 'Africa_Index_Data_2018.xlsx', '<p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(243, 243, 243);\">2018 Africa SDG Index and Dashboards Results (Excel)</span></p>', 2018, 'VCgMbrPp', 'Data', 'en'),
(27, 'Les donnÃ©es de lâ€™Indice des ODD pour l\'Afrique pour lâ€™annÃ©e 2018', 'Africa_Index_Data_2018.xlsx', 'Les rÃ©sultats de l\'Indice et des Tableaux de Bord des ODD pour l\'Afrique pour lâ€™annÃ©e 2018 (Excel)', 2018, 'uiOiPOdn', 'Reports', 'fr');
